INSERT INTO `blocks_opinions` VALUES (1,34,'users/ava1.png','Хороший дом,че','2011-11-12',4,'Коля');
INSERT INTO `blocks_opinions` VALUES (2,34,'users/ava1.png','Хороший дом,че','2011-11-12',1,'Вася');
INSERT INTO `blocks_opinions` VALUES (5,66,'images/users/avatar5.jpg','<p>Мне строили дом по этому проекту, построили в срок и по смете. Живу в построенном доме с женой и дочерью, при своих 70 м2 дом достаточно функционален и уютный.</p>\r\n<p>По завершению строительства, дом сдали в надлежащем виде. В этом я вижу заслугу руководства, которое на всем протяжении процесса строительства обеспечила контроль выполнения работ.</p>\r\n<p>Место очень нравится, весной и летом утром будят звуки природы, а не гул машин.</p>\r\n<p>Моя любимая комната &mdash; это кухня-столовая))<strong><br /></strong></p>','2012-03-05',5,'Андрей');
INSERT INTO `blocks_opinions` VALUES (7,66,'images/users/avatar7.jpg','<p>Продала квартиру и купила этот дом. Понравилось местоположение и сам домик конечно. Если бы в нем была еще одна комната было бы шикарно. Вот думаю над тем, чтобы разделить на две комнаты кухню-столовую.</p>','2009-07-20',4,'Анна');
INSERT INTO `blocks_opinions` VALUES (8,66,'images/users/avatar8.jpg','<p>Мне купил этот дом сын. Давно хотела перебраться из квартиры в частный дом. Зимой в доме очень тепло. Тепло не только из-за мощного котла и радиаторов, но еще из-за того, что полы в доме подогреваются.</p>\r\n<p>Кухня-столовая очень просторная светлая комната. В ней удобно принимать гостей из компании 5-7 человек.</p>\r\n<p>В небольшом заднем дворике я развела симпатичную клумбу с цветами, а теперь хочу завести собаку.</p>','2012-02-10',5,'Вера Михайловна ');
INSERT INTO `blocks_opinions` VALUES (9,63,'images/users/avatar9.jpg','<p>Когда я выбирал дом, я посмотрел около полутора десятка разных вариантов. И этот дом был в числе первых, но при первом впечатлении он меня не &laquo;зацепил&raquo; и я поспешно забыл про него. В поисках очередного предложения в интернете я попал на сайт Алькор-Дом и снова увидел этот дом. И тут я понял, понял, что это именно тот вариант, который мне подходит.</p>\r\n<p>Планировка дома очень интересная и функциональная. На втором этаже две просторные спальни, что дает много вариантов для расстановки мебели. На первом этаже предусмотрено деление кухни-столовой. Я пока не делал с нее две комнаты, мне нравится сейчас то, что в праздничные дни мы можем комфортно расположится с гостями за красиво накрытым столом.</p>\r\n<p>Все-таки двух этажный дом &mdash; это вещь.</p>','2011-07-14',0,'Константин');
INSERT INTO `blocks_opinions` VALUES (10,63,'images/users/avatar10.jpg','<p>Наше знакомство с компанией началось с сорванного объявления об обмене квартир на частный дом стройвариантом плюс 3 сотки земли. Благодаря агенту Алексею за короткий промежуток времени мы вышли на задатки по сделки с недвижимостью.</p>\r\n<p>Далее активную помощь по оформлению бумаг оказал нам юрист компании Артем.</p>\r\n<p>Все недостатки очень качественно и быстро были устранены прорабом, строившим наш дом.</p>\r\n<p>Нам очень нравится купленный дом потому, что:</p>\r\n<p>&mdash; у дома удобное местоположение;</p>\r\n<p>&mdash; дом грамотно расположен на участке;</p>\r\n<p>&mdash; в строительстве дома использовались современные строительные и отделочные материалы;</p>\r\n<p>&mdash; компания предоставляет гарантийное обслуживание дома.</p>\r\n<p>Наша семья благодарит компанию в лице ген. директора за активную помощь и личный контроль в процессе строительства дома.</p>\r\n<p>Коллектив компании &mdash; это сплоченная команда помогающая осуществить людям свои мечты о доме.</p>','2011-06-01',0,'Семья Грековых');
INSERT INTO `blocks_opinions` VALUES (11,63,'images/users/avatar11.jpg','<p>Мне строили этот дом на заказ. Результатом доволен и большую часть отзыва я посвящу самой компании т.к. это ее заслуга.</p>\r\n<p>Благодарю компанию за высокий профессионализм и слаженную работу. Особенно руководителя отдела строительства за умение общаться с заказчиками, терпение и внимание, за организаторские способности, умение быстро и качественно устранить возникшие в работе затруднения.</p>\r\n<p>Выражаю отдельную благодарность ген. директору компании, который сумел подобрать такие кадры и реализует продуманную политику на рынке малоэтажно строительства.</p>\r\n<p>Алькор-Дом я рекомендую всем, кто планирует строительство дома и ценит качество, время и деньги.</p>','2011-04-15',0,'Виктор');
INSERT INTO `blocks_opinions` VALUES (12,72,'images/users/avatar12.jpg','<p>Простой, но при этом уютный дом. Правда очень не хватает еще одной комнаты, которую мы хотели бы задействовать в качестве игровой комнаты для своих детей.</p>\r\n<p>Хотим поблагодарить ген. директора компании и всех сотрудников компании Алькор-Дом за строительство нашего красивого дома и за досрочное включение газа, благодаря чему, мы сможем встретить Новый год уже в нашем доме.</p>','2010-11-25',0,'Семья Леандровых');
INSERT INTO `blocks_opinions` VALUES (13,48,'images/users/avatar13.jpg','<p>Мой дом моя крепость. Этот дом обратил на себя мое и внимание моей жены полукруглым эркером. Сразу возникло желание попасть внутрь и посмотреть, а как же там внутри. Купив дом, мы продолжаем радоваться его интересному внешнему виду.</p>\r\n<p>Планировка, на мой взгляд, простая, но удобная, а может и удобная потому как простая. Первый этаж используем активно днем (готовка, обеды, ужины, дневной досуг), а второй вечером, когда хочется прилечь перед телевизором и начать готовиться ко сну.</p>\r\n<p>Кстати, вначале, я думал, что потолки мансардного этажа будут приносить дискомфорт, но нет. Это учли в проектировании дома и сделали их оптимальной высоты. &nbsp;&nbsp;&nbsp;</p>','2012-03-22',0,'Максим Владимирович');
