INSERT INTO `patterncontents` VALUES (16,'[TEXT_0]','<table class=\"service\"><tr><td valign=top>\r\n<h2>Архитектурное проектирование</h2>\r\n<p><strong>Архитектурный проект</strong> - архитектурная часть документации для строительства и градостроительной документации, содержащая архитектурные решения, которые комплексно учитывают социальные, экономические, функциональные, инженерные, технические, противопожарные, санитарно- гигиенические, экологические, архитектурно- художественные и иные требования к объекту в объеме, необходимом для разработки документации для строительства объектов, в проектировании которых необходимо участие архитектора.\r\n </p>\r\n<p>Индивидуальное проектирование зданий любого типа: дачных домов, коттеджей, особняков, гостиниц и ресторанов.\r\n</p><p>\r\nНизкие цены, короткие сроки и большой опыт проектирования - это преимущества наших архитекторов, работая с которыми Вы сможете увидеть свою мечту, воплощенную в реальность.\r\n</p></td>\r\n<td class=\"delimeter\"> </td>\r\n<td><img class=\"corners\" src=\"images/design/project.png\"></td> \r\n</tr>\r\n</table>',878,NULL,NULL);
INSERT INTO `patterncontents` VALUES (17,'[TEXT_0]','<table class=\"service\"><tr>\r\n<td valign=top><img class=\"corners\" src=\"images/design/building.png\"></td> \r\n<td class=\"delimeter-right\"> </td>\r\n\r\n<td valign=top>\r\n<h2>Строительство коттеджа</h2>\r\n<p>\r\nВ настоящее время рынок строительных услуг сильно насыщен, и задача выбора подходящей строительной компании является достаточно сложной. В связи с этим мы хотели бы обратить ваше внимание на некоторые моменты, которые, чрезвычайно важны при выборе организации, которая будет заниматься вашим объектом.\r\n</p><p> \r\nВо-первых, это деловая репутация компании и ее «портфолио», т.е. перечень успешно завершенных проектов.\r\n </p><p>\r\nСтроительная компания «Алькор-Дом» за годы работы зарекомендовала себя только с самой лучшей стороны, о чем, в частности, свидетельствует наше обширное «портфолио» (некоторые наши работы вы можете посмотреть в разделе <a href=\"http://alkordom.ru/works.html\">«Купить дом»</a>). Как вы можете заметить, приоритетным направлением нашей компании является загородное строительство и реконструкция отдельно стоящих зданий.\r\n </p><p>\r\nВо-вторых, это универсальность компании и ее способность исполнять всю или большую часть работ своими силами.\r\n </p><p>\r\nВ данном вопросе компания «Алькор-Дом» придерживается четкой политики – мы являемся генеральным подрядчиком и самостоятельно выполняем полный комплекс работ, начиная с этапа планирования и разработки проекта и заканчивая всеми строительными работами, от нулевого цикла и до отделочных и пуско-наладочных работ. Подобная универсальность нашей компании обеспечивается наличием в штате высококвалифицированных специалистов, каждый из которых отвечает перед руководителем проекта за свою часть работы.\r\n</p>\r\n</td>\r\n</tr>\r\n</table>',879,NULL,NULL);
INSERT INTO `patterncontents` VALUES (18,'[TEXT_0]','<table class=\"service\"><tr><td valign=top>\r\n<h2>Благоустройство территории</h2>\r\n<p><strong>Работы по благоустройству территории включают в себя:</strong>\r\n<ul>\r\n <li> Создание дорожек и тропинок на участке</li>\r\n <li> Строительство подпорных стенок</li>\r\n <li> Строительство спортивных и детских площадок, придомовых парковочных мест, зон отдыха, хозяйственных зон</li>\r\n <li> Устройство системы наружного и ландшафтного освещения</li>\r\n <li> Устройство системы автополива (автоматический полив)</li>\r\n <li> Устройство дренажной системы и ливневой канализации</li>\r\n <li> Строительство водоемов и водных сооружений различных типов</li>\r\n</ul>\r\n</p><p> \r\nБлагоустройство территории — это целый комплекс работ, позволяющий изменить исходный ландшафт и озеленить территорию. Процесс благоустройства требует специальных знаний и состоит из нескольких необходимых этапов.\r\n</p>\r\n</td>\r\n<td class=\"delimeter\"> </td>\r\n<td><img class=\"corners\" src=\"images/design/bea.png\"></td> \r\n</tr>\r\n</table>',880,NULL,NULL);
INSERT INTO `patterncontents` VALUES (19,'[TEXT_0]','<table class=\"service\"><tr>\r\n<td valign=top><img class=\"corners\" src=\"images/design/design.png\"></td> \r\n<td class=\"delimeter-right\"> </td>\r\n\r\n<td valign=top>\r\n<h2>Дизайн интерьера и отделочные работы</h2>\r\n<p>Вы стали владельцем квартиры, коттеджа, загородного дома или офиса. Возможно, Вы открываете ресторан, кафе,  салон, магазин или студию. Вам нужно создать профессиональный дизайн интерьера, выполнить отделку нежилого помещения или ремонт квартиры? \r\n </p>\r\n<p>\r\nКомпания «Алькор-Дом» стала занимается проектированием дизайна интерьеров, разработкой дизайн-проектов, ремонтом квартир и коттеджей с 2010 года. \r\n </p>\r\n<p>\r\nОпытный коллектив компании «Алькор-Дом» состоит из профессиональных дизайнеров интерьера, художников, декораторов, опытных прорабов и строительно-ремонтных бригад, специализирующихся в области ремонта квартир, дизайна интерьера квартир, декорирования помещений, ремонта офисов и отделки новостроек.\r\n</p>\r\n</td>\r\n</tr>\r\n</table>',881,NULL,NULL);
INSERT INTO `patterncontents` VALUES (24,'[TEXT_0]','<p>Старооскольский кирпич выпускается на Старооскольском кирпичном заводе ОСМиБТ - одном из ведущих предприятий России и СНГ по производству керамической плитки, санкерамики и керамического кирпича. Продукция старооскольского кирпичного завода появилась на рынке строительных материалов с 1991 года, когда российским застройщикам был предложен старооскольский облицовочный кирпич. В 1993 году на старооскольском кирпичном заводе были введены производственные мощности по выпуску керамической плитки, а год спустя оскольский кирпичный завод ввел мощности по производству санитарной керамики.<img class=\"corners\" alt=\"\" width=\"200\" height=\"229\" align=\"right\" style=\"margin:10px;\" src=\"/files/a073b57d43eb0807f813dbeb958838af.jpeg\" /></p> <p>Производить конкурентоспособную продукцию старооскольскому кирпичному заводу позволяют внедрение современных технологических процессов, применение оборудования мировых лидеров в области керамики, а также использование качественных, экологически чистых сырьевых материалов.</p> <p>Вся продукция Старооскольского кирпичного завода ОСМиБТ отвечает как российским нормам и правилам, так и Международным стандартам качества. Это подтверждено сертификатом международного образца аудиторской фирмы TUV CERT о соответствии системы контроля качества требованиям DIN EN ISO 9002. Европейские технологии, современный дизайн, доступные цены, гибкая система скидок, высокий уровень обслуживания розничных и оптовых покупателей оскольского кирпича - это слагаемые успеха продукции старооскольского кирпичного комбината, который зарекомендовал себя как производитель качественной продукции для строительства.</p><p>Все это подтверждается многочисленными наградами и дипломами выданными Старооскольскому кирпичному заводу. В 1997 и 1998 годах на Всероссийском конкурсе лучших строительных организаций (предприятий стройиндустрии)  Старосокольский кирпичный завод ОСМиБТ вошел в число 30 лучших хозяйствующих субъектов, а в 1999 и 2000 годах работа оскольского кирпичного комбината получила самую высокую оценку и Диплом I степени.</p><p>ОСМиБТ Старооскольский кирпичный завод производит оскольский кирпич на итальянской линии (Е1) и французской линии фирмы Ceric (Е2). Собственные карьеры и самый крупный в России цех хранения и переработки кирпича и керамики позволяют поддерживать высокое качество старооскольского кирпича независимо от сезонных и погодных условий. Сертифицированная лаборатория старооскольского кирпичного завода производит контроль качества на всех этапах производственного процесса от карьера до упаковки кирпича на поддоны.</p><p>Оскольский кирпич уникален тем, что перед упаковкой в термоусадочную пленку он проходит стопроцентную сортировку, что исключает попадание в поддоны кирпича брака и боя. </p>',884,NULL,NULL);
INSERT INTO `patterncontents` VALUES (25,'[TEXT_0]','<p><img style=\"margin-right:5px;margin-bottom:5px;\" alt=\"\" width=\"480\" height=\"200\" src=\"/files/201007291124430_Buderus_radiator_Logatrend_VK_profil.jpg\" /></p><p><strong>Панельные радиаторы отопления Logatrend</strong></p> <ul><li>Высокое качество исполнения: При производстве радиаторов Buderus используется роликовая контактная высокочастотная сварка. Опрессовка с номинальным давлением 10 бар;&nbsp;</li><li>Энергоэффективность: экономия до 5% энергии благодаря специальному встроенному термостатическому клапану Danfoss (эксклюзивно разработанного для BOSCH THERMOTECHNIK )</li><li>Гигиеническое исполнение и травмобезопасные края: радиаторы можно монтировать в лечебных и детских учреждениях. Радиаторы Buderus Logatrend VK Profil типов 10, 20 и 30 могут применяться в помещениях с повышенными требованиями к чистоте, так как отсутствуют конвекционные пластины и съемные решетки, что позволяет очень легко дезинфицировать поверхность радиатора.</li><li>Широкий ассортимент позволяет подобрать требуемую тепловую мощность радиаторов, соответствующую температуре теплоносителя, в том числе и довольно низкой (50&ndash;60 &deg;С)<br />&nbsp;</li></ul><p><strong>Простой и быстрый монтаж радиаторов отопления Logatrend VK Profil</strong></p> <p>Простота монтажа: Радиаторы отопления Buderus можно устанавливать любой стороной, так как отсутствуют планки, определяющие заднюю сторону радиатора,&nbsp;<br /> система крепления BMS позволяет крепить радиатор любой стороной, скользящие кронштейны позволяют сдвинуть закреплённый на стене радиатор вправо-влево на 3-5 сантиметров, что облегчает центрирование радиатора на стене, а также &laquo;подгонку&raquo; радиатора под выводы труб из пола.<br /> <br /> <strong>Размеры радиаторов отопления</strong></p> <p>7 типов, 15 длин (от 400 мм до 3000 мм) и 5 высот (от 300 мм до - 900 мм). Варианты исполнения по длине от 400 до 3000 мм с шагом в 100 мм, позволяют получить готовые радиаторы с шагом по мощности в 190 Вт, т.е. не требуется собирать на объекте радиаторы из секций, для адаптации их по мощности, можно получить сразу необходимый типоразмер.<br /> <br /> <strong>Гарантия качества и срок службы радиаторов отопления Logatrend VK Profil</strong></p> <p>Buderus предоставляет полную гарантию на радиаторы в течение 5 лет (как на цикл производства, так и эксплуатации) при условии соблюдения требований СНиП 3.05.01-85. Срок службы радиаторов 25 лет.<br /> <br /> <strong>Высококачественная экологичная окраска и упаковка</strong></p> <ul>     <li>Грунтовка и окраска с горячей сушкой в белый цвет (RAL 9016).&nbsp;</li>     <li>Возможно заказать любой цвет радиатора по RAL (по запросу).</li>     <li>Порошковое лакокрасочное покрытие с горячей сушкой, с высокой устойчивостью к царапинам и ударам.</li>     <li>Упаковка из термоусадочной пленки с защитными уголками для защиты при транспортировке и монтаже.</li>     <li>Для предохранения лакокрасочного покрытия от повреждений термоусадочная пленка может оставаться на радиаторах во время отопления при проведении строительных работ, если температура подающей линии не превышает 60˚С.</li> </ul> <p>&nbsp;</p>',885,NULL,NULL);
INSERT INTO `patterncontents` VALUES (28,'[TEXT_0]','<h2>Преимущества домов перед квартирами</h2>\r\n<table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"width:400px;\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/house.png\" /></td>\r\n            <td>\r\n            <h1 style=\"text-align: center;margin-left:-10px;\"><strong><span style=\"color:#FFFFFF;\">VS</span></strong></h1>\r\n            </td>\r\n            <td style=\"width:400px;\" align=\"right\" valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/flat.png\" /></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n    <tbody>\r\n        <tr>\r\n            <td valign=\"top\" colspan=\"2\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/1.jpg\" /></td>\r\n                        <td style=\"padding-top:150px;\">\r\n                        <h2 style=\"margin-left:10px;\"><strong>1. Цена</strong></h2>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Новый двухкомнатный дом 70 м<sup>2</sup> на участке 3 сотки</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/1.jpg\" /> &nbsp;</td>\r\n                        <td style=\"padding-top:170px;\">\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Не новая двухкомнатная квартира 50 м<sup>2</sup> в панельном доме</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/3.jpg\" /></td>\r\n                        <td style=\"padding-top:150px;\">\r\n                        <h2 style=\"margin-left:10px;\"><strong>2. Парковка</strong></h2>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">У вас будет собственный гараж или навес под машину, а также гостевая парковка на несколько автомобилей. Все это доступно для вас в собственном доме.</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n            <td valign=\"top\">&nbsp;</td>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/2.jpg\" /> &nbsp;</td>\r\n                        <td style=\"padding-top:190px;\">\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Стоимость парковочного места в подземном гараже составляет около 1 млн. рублей плюс ежемесячная арендная плата от 2 500 руб./мес.</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/4.jpg\" /></td>\r\n                        <td style=\"padding-top:150px;\">\r\n                        <h2 style=\"margin-left:10px;\"><strong>3. Индивидуальность</strong></h2>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Купить дом можно готовый, или заказать его строительство по одному из выбранных вами проектов.</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">&nbsp;</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">В этом случае индивидуальность будет прослеживаться во всем. Начиная от внешнего вида дома, его этажности, цвета кирпича и кровли крыши, планировки дома, количества и функционального назначения комнат, внутренней отделки и заканчивая планировкой территории двора.</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n            <td valign=\"top\">&nbsp;</td>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/5.jpg\" /> &nbsp;</td>\r\n                        <td style=\"padding-top:190px;\">\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">При покупке квартиры вам позволяется всего лишь стандартные планировки с маленькими возможностями ее изменения, а о дворе в этом случае речь даже не идет.</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/6.jpg\" /></td>\r\n                        <td style=\"padding-top:150px;\">\r\n                        <h2 style=\"margin-left:10px;\"><strong>4.&nbsp;Земля&nbsp;и&nbsp;собственность</strong></h2>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Купив дом или заказав строительство дома, вы становитесь собственником земельного участка.&nbsp;</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">&nbsp;</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Размеры земельного участка больше площади застройки дома, в итоге, помимо дома и участка земли, вы становитесь обладателем собственного гаража, гостевой парковки, садовых клумб,  хозяйственной пристройки и др.</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n            <td valign=\"top\">&nbsp;</td>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/7.jpg\" /> &nbsp;</td>\r\n                        <td style=\"padding-top:190px;\">\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Кроме квартиры вам ничего не принадлежит.</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">&nbsp;</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Собственность начинается от входной двери и заканчивается лоджией. <br />\r\n                        Территория двора, детские площадки, места парковки, скамейки и т.д., которыми вы пользуетесь, эксплуатируются также другими многочисленными людьми, живущими в домах расположенных рядом.</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/8.jpg\" /></td>\r\n                        <td style=\"padding-top:150px;\">\r\n                        <h2 style=\"margin-left:10px;\"><strong>5.&nbsp;Экология&nbsp;и&nbsp;природа</strong></h2>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Владея собственным домом, вы становитесь окруженными чистым воздухом, тишиной, пением птиц и многими другими положительными факторами. Все они благоприятно влияют как на психическое, так и на физическое здоровье человека.&nbsp;</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n            <td valign=\"top\">&nbsp;</td>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/9.jpg\" /> &nbsp;</td>\r\n                        <td style=\"padding-top:190px;\">\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Природная среда и экология практически отсутствуют там, где речь идет о городе.</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">&nbsp;</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Очень повезет, если недалеко будет находиться парк.</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/10.jpg\" /></td>\r\n                        <td style=\"padding-top:150px;\">\r\n                        <h2 style=\"margin-left:10px;\"><strong>6. Соседи</strong></h2>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Те, кто купил дом, чаще обладают одинаковым с интересами. Дружба в этом случае между соседями не редкость, вплоть до совместных воскресных пикников или походов на рыбалку.&nbsp;</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n            <td valign=\"top\">&nbsp;</td>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/11.jpg\" /> &nbsp;</td>\r\n                        <td style=\"padding-top:190px;\">\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">В квартире, соседи это источник отрицательных эмоций и убытков. Практически всех хотя бы раз заливали соседи сверху. В выходной день обязательно кто-то из соседей будил стуком молотка или перфоратором. А о совпадении ваших музыкальных предпочтений и биологических ритмов с соседями за стеной можно даже не говорить. Подробностям семейной жизни одних соседей и частота грудного вскармливания ребенка других соседей вряд ли будет радовать вас.</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/12.jpg\" /></td>\r\n                        <td style=\"padding-top:150px;\">\r\n                        <h2 style=\"margin-left:10px;\"><strong>7. Коммуникации</strong></h2>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">В доме у вас будут автономные коммуникации.</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">&nbsp;</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Когда включать или отключать отопление, в зависимости от погоды, вы будете решать сами, а не тот, кому так посчиталось удобным и выгодным для него.&nbsp;<br />\r\n                        &nbsp;</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">&nbsp;</div>\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Горячая вода у вас в доме будет всегда, если есть холодная.&nbsp;</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n            <td valign=\"top\">&nbsp;</td>\r\n            <td valign=\"top\">\r\n            <table width=\"100%\" border=\"0\" cellpadding=\"1\" cellspacing=\"1\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td valign=\"top\"><img alt=\"\" src=\"http://www.alkordom.ru/images/besthouse/14.jpg\" /> &nbsp;</td>\r\n                        <td style=\"padding-top:190px;\">\r\n                        <div style=\"border-left:1px solid gray;padding-left:10px;\">Отопление в квартире дают по определенному календарному плану, а также профилактически отключают горячую воду, которую дают как обычно с несколькими недельными задержками.</div>\r\n                        </td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n<p>&nbsp;</p>',886,NULL,NULL);
INSERT INTO `patterncontents` VALUES (29,'[TEXT_0]','<p>Сейчас уже никто не отрицает преимущество жизни в собственном доме в отличие от квартиры.  Большая часть людей, которая купили, и живет в квартире, желают перебраться в собственный дом. Реализовав это можно поменяв квартиру на дом.</p><p>Это решение вполне очевидно, ведь преимуществ у собственного дома перед квартирой большое количество, мы их перечислили выше. Обратите внимание, что даже нет, не одной пословице, которая была бы посвящена квартире, хотя про собственный дом их предостаточно.</p><p>Нет ни одного магазина строительных и отделочных материалов, в названии которого было бы слово &laquo;квартира&raquo;, а со словом &laquo;дом&raquo; их достаточно много.</p>',887,NULL,NULL);
INSERT INTO `patterncontents` VALUES (31,'[TEXT_0]','<p class=\"MsoListParagraph\" style=\"margin-left:0cm;text-indent:0cm;mso-list:l0 level1 lfo1\"><p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Найти участок и убедиться что это именно он.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Если есть старые постройки или дома, найти и переписать данные с счетчиков.(газ, свет, вода)</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Найти правление садоводства и заверить у председателя данные счетчиков.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">При спиле деревьев направлять падение тросом или веревкой. Не валить деревья на соседний участок, не ломать соседний забор без согласования.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Не складывать мусор на месте фундамента, сливной ямы, дороги, подъезда автобетоновоза.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">6.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">При сжигании мусора и веток следить за огнем.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">7.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Не оставлять огонь на ночь (в летнее время особенно).</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">8.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">В летнее время для сжигания мусора выкапывается яма, место расположения ямы не должно попасть на линию фундамента.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">9.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Не засыпать подвалы старых домов без учета проекта будущих домов.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">10.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Если позволяют условия, завозим кирпич и песок для кладки сливной ямы в конец участка перед началом копки фундаментов.</span></p></p>',889,NULL,NULL);
INSERT INTO `patterncontents` VALUES (32,'[TEXT_0]','<p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Размечаем согласно чертежу место расположения и размеры ямы.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">При </span><span lang=\"EN-US\" style=\"font-size:14.0pt;&#xa;mso-ansi-language:EN-US\">t</span><span style=\"font-size:14.0pt\"><span style=\"mso-spacerun:yes\">&nbsp; </span>воздуха ниже 0<sup>0</sup>С добавляем поташ, греем воду.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Соотношение цемента М500 и песка 1:3 - летом<span style=\"mso-spacerun:yes\">&nbsp; </span>и<span style=\"mso-spacerun:yes\">&nbsp; </span>1:2,5 - зимой.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Кирпич используется полнотелый керамика.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Первые семь<span style=\"mso-spacerun:yes\">&nbsp; </span>рядов поднимаем без отверстий с перевязкой<span style=\"mso-spacerun:yes\">&nbsp; </span>тычком 1-й, 4-й, и 7-й ряд.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">6.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">С 7-го ряда открываем отверстия на ширину 3-4 см &asymp; 3 ряда, затем 3 ряда сплошником без<span style=\"mso-spacerun:yes\">&nbsp; </span>отверстий.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">7.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Последние 1,5 м. ямы, отверстия не открываются.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">8.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Стена ямы кладется по периметру в 1 кирпич (250 мм) h=1,7 м., остальные 1,3 м. в &frac12; кирпича (120 мм) при глубине ямы<span style=\"mso-spacerun:yes\">&nbsp; </span>в 3,5 м.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">9.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">0,5 м остается для: </span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt\"><span style=\"font-size:&#xa;14.0pt\">-устройства ж/б монолитной плиты(0,1 м), </span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt\"><span style=\"font-size:&#xa;14.0pt\">- обратной засыпки (0,4 м)</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">10.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Средняя перегородка выполняется без отверстий, если яма на два дома и с отверстиями (как наружная стена) если яма для одного дома.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">11.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Перегородка в яме поднимается в 1 кирпич &delta;=250 мм. на h=1м., затем в &frac12; кирпича &delta;=120 мм..</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:36.0pt;text-indent:-18.0pt;&#xa;mso-list:l0 level1 lfo1\"><span style=\"mso-fareast-font-family:&#xa;Calibri;mso-bidi-font-family:Calibri\"><span style=\"mso-list:Ignore\">12.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp; </span></span></span><span style=\"font-size:14.0pt\">Оставляем отверстия под канализационные трубы 2 шт. по краям ямы, и 8 шт. ниш, для балок под опалубку.</span></p>   <p>&nbsp;</p>',890,NULL,NULL);
INSERT INTO `patterncontents` VALUES (33,'[TEXT_0]','<p class=\"MsoListParagraph\" style=\"margin-bottom:6.0pt;text-align:justify;&#xa;line-height:normal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:14.0pt\">Последовательность работ</span></b></p>  <p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:&#xa;6.0pt;margin-left:1.5pt;text-align:justify;text-indent:-.75pt;line-height:normal;&#xa;tab-stops:1.5pt 35.45pt\"><span style=\"font-size:14.0pt\">1. Изучить инструкцию и усвоить последовательность работ.</span></p>  <p class=\"MsoListParagraph\" align=\"center\" style=\"margin-bottom:6.0pt;text-align:&#xa;center;line-height:normal\"><u><span style=\"font-size:15.0pt\">Разбивка</span></u></p>  <p class=\"MsoListParagraph\" style=\"margin-bottom:6.0pt;text-align:justify;&#xa;line-height:normal\"><span style=\"font-size:15.0pt\">2.<span style=\"mso-spacerun:yes\">&nbsp; </span>Получить чертеж (проект) под подпись.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-bottom:6.0pt;text-align:justify;&#xa;line-height:normal\"><span style=\"font-size:15.0pt\">3.<span style=\"mso-spacerun:yes\">&nbsp; </span>Ознакомиться, изучить, понять проект.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-bottom:6.0pt;text-align:justify;&#xa;line-height:normal\"><span style=\"font-size:15.0pt\">4. Определить межевую линию к которой привязывается дом, и согласовать с руководителем отдела.</span></p>  <p class=\"MsoNormal\" style=\"margin-bottom:6.0pt;text-align:justify;line-height:&#xa;normal\"><span style=\"font-size:14.0pt\">5.<span style=\"mso-spacerun:yes\">&nbsp; </span>Разбить фундамент на участке.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-bottom:6.0pt;text-align:justify;&#xa;line-height:normal\"><span style=\"font-size:14.0pt\">6.<span style=\"mso-spacerun:yes\">&nbsp; </span>Сдать разбивку руководителю отдела.</span></p>  <p class=\"MsoListParagraph\" align=\"center\" style=\"margin-top:0cm;margin-right:0cm;&#xa;margin-bottom:6.0pt;margin-left:21.3pt;text-align:center;line-height:normal\"><u><span style=\"font-size:14.0pt\">Траншея</span></u></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">7.<span style=\"mso-spacerun:yes\">&nbsp; </span>Разработка грунта траншей фундамента.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">8.<span style=\"mso-spacerun:yes\">&nbsp; </span>Устройство расширения опоры фундамента.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">9. Вычистка траншей и сдача руководителю отдела.</span></p>  <p class=\"MsoListParagraph\" align=\"center\" style=\"text-align:center;mso-line-height-alt:&#xa;5.0pt\"><u><span style=\"font-size:14.0pt\">Опалубка</span></u></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">10. Уяснить технологию установки опалубки.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">11.Посчитать и заказать доску для опалубки.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">12. Установить опалубку.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">13. Сдать опалубку руководителю отдела.</span></p>  <p class=\"MsoListParagraph\" align=\"center\" style=\"margin-left:21.3pt;text-align:&#xa;center;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><u><span style=\"font-size:14.0pt\">Армирование</span></u></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">14. Изучить технологию армирования.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">15. Посчитать и заказать арматуру, проволоку, согласовав с руководителем отдела.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">16. Заармировать фундаменты.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">17. Установить закладные детали под воду и канализацию.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">18. Сдать армирование руководителю отдела.</span></p>  <p class=\"a\" align=\"center\" style=\"margin-left:21.3pt;text-align:center;text-indent:&#xa;-21.3pt;mso-line-height-alt:5.0pt\"><u><span style=\"font-size:14.0pt\">Бетонирование</span></u></p>  <p class=\"a\" style=\"margin-left:21.3pt;text-indent:-21.3pt;mso-line-height-alt:&#xa;5.0pt\"><span style=\"font-size:14.0pt\">19.Посчитать и согласовать объем бетона с р.о.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">20. Заказать снабженцу (за 2 дня до заливки).</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">21. Бетонирование фундамента.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">22. Уход за бетоном.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt;mso-line-height-alt:5.0pt\"><span style=\"font-size:14.0pt\">23. Подсчет объемов бетона и заработной платы с устройства фундаментов.</span></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt\"><o:p>&nbsp;</o:p></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:14.0pt\">3.2. Инструкции к выполнению</span></b></p>  <p class=\"MsoListParagraph\" style=\"margin-left:21.3pt;text-align:justify;&#xa;text-indent:-21.3pt\"><u><span style=\"font-size:14.0pt\">Разбивка</span></u></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-.75pt;&#xa;tab-stops:0cm 35.45pt\"><span style=\"font-size:14.0pt\">1. Дома привязывают к межевой линии в соответствии с проектом.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-.75pt;&#xa;tab-stops:0cm 35.45pt\"><span style=\"font-size:14.0pt\">2. Разбивку фундамента осуществлять с выносками на 0,5м от углов фундамента.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-.75pt;&#xa;tab-stops:0cm 35.45pt\"><span style=\"font-size:14.0pt\">3. Пересечение шнурок выставить в верное проектное положение углов дома (проверить длины сторон и диагонали).</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-.75pt;&#xa;tab-stops:0cm 35.45pt\"><u><span style=\"font-size:14.0pt\">Разработка грунта</span></u></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-.75pt;&#xa;tab-stops:0cm 35.45pt\"><span style=\"font-size:14.0pt\">4. Копать фундаменты строго по линии натянутой шнурки.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify;text-indent:-.75pt;&#xa;tab-stops:0cm 35.45pt\"><span style=\"font-size:14.0pt\">5. Подошва фундамента копается в горизонте по уровню.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">6 Рыхлый грунт должен быть удален с кромки и стенок траншей.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">7 Отклонения ширины траншей не должны превышать 1 см.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>- Одноэтажный дом</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">8 Фундаменты капаются глубиной </span><span lang=\"EN-US\" style=\"font-size:14.0pt;mso-ansi-language:EN-US\">min</span><span style=\"font-size:14.0pt\"> 0,9м в самой нижней точке.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">9. Капиталка копается глубиной 0,6м одна или две шт. в зависимости от проекта (по согласованию с руководителем отдела).</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">10. Ширина траншей 0,4м.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>- Двухэтажный дом</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">11. Фундаменты копаются глубиной </span><span lang=\"EN-US\" style=\"font-size:14.0pt;mso-ansi-language:EN-US\">min</span><span style=\"font-size:14.0pt\"> 1,2м в самой нижней точке<span style=\"mso-spacerun:yes\">&nbsp; </span>поверхности земли</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">12. Ширина траншей 0,4м если стена в полблока и 0,52м если стена в блок.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">13. Отметка подошвы капиталки копается на том же уровне, что и основные фундаменты с расширением в подошве.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">14. Ширина капиталки 0,4м.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><u><span style=\"font-size:&#xa;14.0pt\">Опалубка</span></u></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">15. Опалубка выставляется по уровню поверхности земли.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">16. Опалубка должна быть крепко закреплена и выставлена в проектное положение (проверить длины сторон и диагонали).</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><o:p>&nbsp;</o:p></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">17. Ширина опалубки ровна ширине фундамента + 2см (1см во внутрь и 1 см наружу).</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">18. Все отверстия и ниши между траншеей или опалубкой, должны быть засыпаны или забиты.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><u><span style=\"font-size:&#xa;14.0pt\">Армирование</span></u></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">19. Армирование осуществляется в горизонте с подошвой фундамента и в соответствии с проектом.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">20. Верхний защитный слой бетона от верхней рабочей арматуры должен быть 5см.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">21. Нижний защитный слой бетона от нижней рабочей арматуры должен быть 10см.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">22. В углах и пересечениях фундамента с капиталкой, рабочая верхняя и нижняя арматуры усиливаются угловыми усилениями 1мх1м, на каждую рабочую жилу.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">23. Перехлест арматуры не &lt; 40ф.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">24. В углах фундаментов установить по 4 стойки арматуры.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">25. По длине фундамента арматурные стойки устанавливаются на расстоянии через 1,2м-1,3м.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">26. Вязка арматуры в пересечениях производится, производится дважды проволокой ф1,2мм крест на крест.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">27. <i style=\"mso-bidi-font-style:normal\">В одноэтажном доме</i>: фундамент армируется в 8 жил: 3 верхних, 2 средних, 3 нижних &ndash; ф 12А</span><span lang=\"EN-US\" style=\"font-size:14.0pt;mso-ansi-language:EN-US\">III</span><span style=\"font-size:14.0pt\">.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><i style=\"mso-bidi-font-style:&#xa;normal\"><span style=\"font-size:14.0pt\">- В двухэтажном доме:</span></i></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">28. фундамент шириной 0,4м армируется в 9 жил: 3 верхних, 2 средних, 4 нижних &ndash; ф 12А</span><span lang=\"EN-US\" style=\"font-size:14.0pt;mso-ansi-language:&#xa;EN-US\">III</span><span style=\"font-size:14.0pt\">.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">29. фундамент шириной 0,52м армируется в 11 жил: 4 верхних, 3 средних, 4 нижних &ndash; ф 14А</span><span lang=\"EN-US\" style=\"font-size:14.0pt;mso-ansi-language:&#xa;EN-US\">III</span><span style=\"font-size:14.0pt\">.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">30. На эркерах так же используется арматура и угловые усиления того же диаметра, что и в основном фундаменте.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><u><span style=\"font-size:&#xa;14.0pt\">Закладные</span></u></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">31. Установить закладные по проекту: для воды на глубине 1-1,1,м от поверхностью земли, для канализации на глубине 0,5-0,6м от поверхности земли.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><u><span style=\"font-size:&#xa;14.0pt\">Бетонирование</span></u></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">32. Бетонирование в зимнее время допускается не ниже -5&nbsp;С.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">33. Бетонирование осуществлять с лотка автобетоновоза или автобетононасосом (по согласованию с руководителем отдела).</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">34. При бетонировании обязательно вибрировать и шныковать бетон.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">35. Уровень бетона задается в горизонте в пределах высоты опалубочной доски (если не задается проектом идеальная горизонтальность).</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">36. При заливке бетона в жаркое (летнее) время не добавлять воду в больших количествах, в холодное (зимнее) время добавлять воду запрещено.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><u><span style=\"font-size:&#xa;14.0pt\">Уход за бетоном</span></u></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">37. Не допускать<span style=\"mso-spacerun:yes\">&nbsp; </span>попадание грунта в тело бетона.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">38. При температуре воздуха от 0 до - 5&nbsp;С бетон после заливки накрывается минераловатной плитой толщиной 5см огражденной от бетона и улицы двойной пленкой.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">39. Не зависимо от погоды, после заливки бетон накрывается пленкой.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">40. После заливки фундаментов производится уход за бетоном: </span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">а) Зимой &ndash; ежедневное наблюдение за бетоном (не допустить замерзание бетона)</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\">б) Летом &ndash; каждые 3 часа полив бетона водой.</span></p>  <p class=\"MsoListParagraph\" style=\"text-align:justify\"><span style=\"font-size:&#xa;14.0pt\"><o:p>&nbsp;</o:p></span></p>  <p class=\"MsoListParagraph\" align=\"center\" style=\"text-align:center\"><i style=\"mso-bidi-font-style:normal\"><span style=\"font-size:16.0pt\">Разрезы фундаментов:</span></i></p>  <p class=\"MsoListParagraph\" align=\"center\" style=\"text-align:center\"><i style=\"mso-bidi-font-style:normal\"><span style=\"font-size:16.0pt\"><o:p>&nbsp;</o:p></span></i></p>  <p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:&#xa;0cm;margin-left:-21.25pt;margin-bottom:.0001pt;line-height:normal;tab-stops:&#xa;14.2pt\"><span style=\"font-size:14.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16.0pt\">1</span><span style=\"font-size:&#xa;14.0pt\">эт. дом<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;</span>2х</span><span style=\"font-size:14.0pt\"> эт. дом<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><span style=\"font-size:16.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;</span>2х</span><span style=\"font-size:14.0pt\"> эт. дом </span><span lang=\"EN-US\" style=\"font-size:&#xa;14.0pt;mso-ansi-language:EN-US\">VIP</span><span lang=\"EN-US\" style=\"font-size:&#xa;14.0pt\"> </span><span style=\"font-size:14.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></p>  <p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:&#xa;0cm;margin-left:-21.25pt;margin-bottom:.0001pt;line-height:normal;tab-stops:&#xa;14.2pt\"><span style=\"font-size:14.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>сегмент</span></p>   <p>&nbsp;</p>',891,NULL,NULL);
INSERT INTO `patterncontents` VALUES (34,'[TEXT_0]','<p class=\"MsoListParagraphbullet1.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>Перед кладкой цоколя очистить фундамент от земли, песка, наледи, снега, засохших наплывов бетона.</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>Кирпич, используемый в кладку, также очищается от земли, наледи, снега.</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>Проверить диагонали и разметить углы цоколя;</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>Кладка ведется с перевязкой 1 ряд<span style=\"mso-spacerun:yes\">&nbsp; </span>тычок, 1 ряд ложок;</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>Все швы, горизонтальные и вертикальные, должны быть плотно забиты раствором;</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">6.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>На ровных участках, когда перепад в отметках не более 30см, количество рядов цоколя в самом высоком месте фундамента - 3 ряда (шириной в 1,5 или 2 кирпича, в зависимости от проектной ширины фундамента) +2 ряда в 1/2 кирпича (опалубочные);</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">7.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>На участках где перепад поверхности земли более 30см, высота цоколя и количество рядов кирпича в цоколе <u>согласовывается с руководителем отдела</u>.</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">8.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>Отметка цоколя должна быть в горизонте, допуск отклонений 4мм по уровню;</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">9.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span>Толщина шва должна быть от 1 до 3 см</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">10.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>Если разница в порядовке составляет от 4 до 6см, тогда ставится опалубка и отметка фундамента выравнивается бетоном. Соотношение бетона цемент : песок : щебень &ndash; 1:3:5</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">11.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>Последний ряд кирпичей, на который будет заливаться плита, должен забиваться раствором, для защиты швов от попадания грунта при засыпке.</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">12.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>Последний ряд по внутренней версте цоколя, должен быть тычковым;</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">13.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>Для устройства дополнительных балок в плите, устраивают ниши шириной в кирпич высотой в 2 ряда кирпича;</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">14.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>На типовых прямоугольных домах ниши для опирание балок устраиваются по меньшим сторонам цоколя в количестве- 2х, и делят меньшие стороны на 3 равных отрезка. Если проект дома со сложной конфигурацией, то количество ниш согласовывается с руководителем отдела.</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">15.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>Под канализационные трубы оставляются ниши в капитальных стенах;</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">16.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>Отметка цоколя выводится<span style=\"mso-spacerun:yes\">&nbsp; </span>в горизонт не по всей высоте цоколя, а первыми 3мя рядами.</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">17.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>Все стороны цоколя должны быть в вертикали и горизонтали;</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">18.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>На фундаменте капитальной стены цоколь кладется из кирпича без 2х рядов опалубочных.</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">19.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>Ширина цоколя под капиталку 1,5 кирпича (0,38м) во всех 2-х этажных домах (если капиталка одна), в 1 кирпич (0,25м) на 1 этажных домах;</p>  <p class=\"MsoListParagraphbullet2.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">20.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>Раствор в зимнее время имеет состав цемента и песка 1:2, в летнее время 1:3;</p>  <p class=\"MsoListParagraphbullet3.gif\" style=\"margin-left:71.45pt;mso-add-space:&#xa;auto;text-align:justify;text-indent:-18.0pt;line-height:150%;mso-list:l0 level1 lfo1\"><span style=\"mso-list:Ignore\">21.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp; </span></span>В зимнее время кладка ведется при <span lang=\"EN-US\" style=\"mso-ansi-language:EN-US\">t</span> не ниже<span style=\"mso-spacerun:yes\">&nbsp; </span>-5˚С с добавлением поташа<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp; </span>(смотреть инструкцию)</p>   <p>&nbsp;</p>',892,NULL,NULL);
INSERT INTO `patterncontents` VALUES (35,'[TEXT_0]','<p class=\"MsoListParagraphbullet1.gif\" style=\"margin-left: 54pt; text-indent: -18pt; line-height: 150%; text-align: left\"><span style=\"mso-list:Ignore\">1.\tКанализация собирается после обратной засыпки цоколя.<br />2.\tВырабатывается грунт в траншеи глубиной 0,3м от низа плиты, по направлению раскладки канализации (смотреть проект), вырабатывается грунт и находится закладная в фундаменте под канализацию.<br />3.\tТруба укладывается полипропиленовая &Oslash; 110мм на 10см песчаной подушке, с уклоном 0,5-2%, после монтажа засыпается песком до уровня низа плиты.<br />4.\tКанализационные раструбы поднимаются от верха плиты на 13см;<br />5.\tРаструбы канализационных стояков закрываются заглушками;<br />6.\tПосле монтажа канализации обязательно пролить водой, проверить уклон и  соединения  канализационных труб.<br /><br />Специфичные правила (согласовывать с руководителем отдела).<br />1.\tКанализационные раструбы устраивать в 5-15см от несущих стен (в зависимости от проекта конструкции несущей стены) и 30 см от межкомнатных перегородок.<br />2.\tВ с/у устраиваются 3 раструба &Oslash;110мм, на кухне 1 раструб &Oslash;100мм, в топочной 1 раструб &Oslash;110мм (если количество не указано в проекте);<br />3.\tВ двухэтажном доме изучается проект и выбирается место расположения стояка на 2ой этаж, в том месте раструб устраивается 10см от перегородки и 6см от стены;<br />4.\tЕсли направление канализации пересекает усиливающие балки, то траншеи прокапывают под балками, потом засыпают песком и уплотняют до уровня низа балок;<br />Перед армированием, сдать собранную канализацию руководителю отдела<br /></span></p>',893,NULL,NULL);
INSERT INTO `patterncontents` VALUES (36,'[TEXT_0]','<h2>Инвестиционные предложения</h2>\r\n<table class=\"invest investfirst\"><tr>\r\n<td class=\"digittd\" align=right><div class=\"digit\" style=\"width:250px;\">1</div></td><td valign=top><div class=\"gray\"><div class=\"text\">безопасность</div></div>\r\n<div class=\"longtext\">\r\nИнвестиции в недвижимое имущество традиционно считаются наиболее консервативным и безлопастным способом как сохранения, так и увеличения капитала. \r\n<p>\r\nМногие авторитетные инвестиционные аналитики утверждают, что спрос на жилье достаточно стабилен, а потому потерять большую сумму при вложении в недвижимость просто невозможно.</p>\r\n</div>\r\n</td><td style=\"width:300px;\"></td></tr></table>\r\n<hr class=\"hrgray\">\r\n\r\n<table class=\"invest investsecond\"><tr>\r\n<td valign=top style=\"width:100px;\"></td><td valign=top><div class=\"red\" style=\"margin-left:30px;\"><div class=\"text\">стабильность</div></div>\r\n<div class=\"longtext\" style=\"width:90%\">\r\nИнвестиции в недвижимость наиболее устойчивые к различным колебаниям в политической и экономической сферах страны, они сохраняют свою рентабельность и остаются быть перспективными.\r\n\r\n<p>За всю двадцатилетнюю историю частной собственности в России, цены на недвижимость падали только два раза: в 1998 году в связи с дефолтом и в 2009 году из-за мирового финансового кризиса. Но это снижение продолжалось не долго и уже через год стоимость недвижимости возвращалась на докризисный уровень, а через некоторое время вновь начинала расти. В среднем рост цен на недвижимость по стране в последние несколько лет составляет примерно 3-5 % в год.</p></div>\r\n</td>\r\n<td class=\"digittd\" align=right><div class=\"digit\">2</div></td>\r\n</tr></table>\r\n<hr class=\"hrgray\">\r\n\r\n\r\n<table class=\"invest investlast\"><tr>\r\n<td class=\"digittd\"></td><td valign=top style=\"width:300px;\"><div class=\"green\"><div class=\"text\">прибыль 18%</div></div>\r\n<div class=\"longtext\">\r\nКак правило, люди, которые выступают в качестве инвестора или соинвестора,  вложившие свои средства в строительство частных домов, через 7-8 месяцев получают прибыль 18-20%.\r\n\r\nИнвестировать  свои денежные средства можно как в уже строящиеся частные дома, так и выбрав проект дома и вложить в него свои деньги.</div>\r\n</td></tr></table>\r\n\r\n\r\n',894,NULL,NULL);
INSERT INTO `patterncontents` VALUES (37,'[TEXT_0]','Компания Алькор-Дом предлагает <span class=\"bigintext\" style=\"font-size:30px;\">более 50 инвестиционных проектов</span> с которыми можно ознакомится у нас в офисе. <p><div class=\"left\" style=\"margin-top:20px;\">Предварительно звоните по телефону </div> <div class=\"hphone\">\r\n<span class=\"small\">(863) </span>\r\n<span class=\"big\">260-14-46</span>\r\n</div></p>',895,NULL,NULL);
INSERT INTO `patterncontents` VALUES (38,'[TEXT_0]','<h1>Работа в Алькор-Дом</h1>\r\n<p>В связи с ростом компании и увеличением объемов строительных работ, компания Алькор-Дом приглашает на постоянную работу специалистов строительных специальностей. Список вакансий представлен ниже.\r\n</p>\r\n<p>Ответственность, трудолюбие и дисциплина — это базовые требования и черты характера, которыми должен обладать кандидата на соискания строительных вакансий в компании Алькор-Дом.\r\n</p>\r\n<p>Для записи на собеседования, предварительно заполните анкету на сайте, или вышлите свое резюме. Обязательно укажите свое контакты для обратной связи с вами.</p>',896,NULL,NULL);
