INSERT INTO `patterncontents` VALUES (40,'[TEXT_0]','<h1>Купить дом</h1>\r\n\r\n<p>Наш <b>каталог частных домов и коттеджей</b> поможет вам найти, выбрать и <b>купить дом</b>, который вы давно хотите. В каталоге представлено широкое разнообразие предложений, от домов находящихся на начальной и завершающийся стадии строительства, до <b>готовых домов под ключ</b>.</p>\r\n\r\n<p>В каталоге вы ознакомитесь с фото домов и коттеджей, их планировками, описанием, инфраструктурой и отзывами людей купивших дом, построенный по аналогичному проекту.</p>\r\n<p>Мы занимаемся продажей частных и загородных домов уже несколько лет и постоянно обновляем свой каталог, с целью реализации вашего желания &mdash; <b>купить частный дом.</b></p>\r\n\r\n<p>Продажа <b>частных домов в Ростове-на-Дону</b> &mdash; является одним из основных направлений деятельности компании Алькор-Дом. Мы существуем на рынке загородной недвижимости долгое время, большую часть которого посвятили продаже частных домов в любой ценовой категории. </p><p></p>',897,NULL,NULL);
