INSERT INTO `patterncontents` VALUES (61,'[TEXT_0]','<p>\r\n\tОбязуюсь не предоставлять (не вводить) в данной форме персональные данные третьих лиц.</p>\r\n<p>\r\n\tЯ гарантирую, что имею полномочия представлять (в том числе в каталоге компаний веб-сайта http://www.ooonrk.ru) указанное мной в данной регистрационной форме юридическое лицо, по вопросам его коммерческой деятельности.</p>\r\n<p>\r\n\tСвои собственные персональные данные я предоставляю (ввожу) добровольно и сознательно в данную регистрационную форму, с целью использования их в каталоге компаний (контрагентов НРК), а именно &mdash; с целью представлять указанное мной юридическое лицо по вопросам его деятельности.</p>\r\n',918,NULL,NULL);
