INSERT INTO `patterncontents` VALUES (68,'[TEXT_0]','<div class=\"row-fluid\">\r\n\t<div class=\"span5\">\r\n\t\t<p>\r\n\t\t\t<strong style=\"font-size:150%\">Медицинский представитель</strong></p>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Профессиональные требования:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\t&nbsp;знания в области искусства продаж</li>\r\n\t\t\t<li>\r\n\t\t\t\t&nbsp;высшее или среднее-специальное образование</li>\r\n\t\t\t<li>\r\n\t\t\t\t&nbsp;наличие личного автомобиля и ВУ</li>\r\n\t\t\t<li>\r\n\t\t\t\t&nbsp;медицинское образование и знания в области медицинского ассортимента приветствуются</li>\r\n\t\t\t<li>\r\n\t\t\t\tопыт работы на аналогичной должности</li>\r\n\t\t\t<li>\r\n\t\t\t\tответственность&sbquo; пунктуальность</li>\r\n\t\t\t<li>\r\n\t\t\t\tориентация на результат</li>\r\n\t\t\t<li>\r\n\t\t\t\tготовность к командировкам</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t<strong><span style=\"color:#696969;\">Обязанности</span>:</strong></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tвзаимодействие с лечебными учреждениями</li>\r\n\t\t\t<li>\r\n\t\t\t\tпродвижение товара</li>\r\n\t\t\t<li>\r\n\t\t\t\tпредставление интересов компании</li>\r\n\t\t\t<li>\r\n\t\t\t\tкомандировки ЮФО</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t<strong><span style=\"color:#696969;\">Условия</span>:</strong></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tграфик работы 5/2</li>\r\n\t\t\t<li>\r\n\t\t\t\tдостойная заработная плата по результатам собеседования</li>\r\n\t\t\t<li>\r\n\t\t\t\tотпуск/ больничный лист</li>\r\n\t\t\t<li>\r\n\t\t\t\tоплата ГСМ</li>\r\n\t\t\t<li>\r\n\t\t\t\tобучение</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t&nbsp;</p>\r\n\t\t<p>\r\n\t\t\t&nbsp;</p>\r\n\t\t<p>\r\n\t\t\t<strong style=\"font-size:150%\">Менеджер в отдел закупок</strong></p>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Профессиональные требования:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tвысшее профильное образование</li>\r\n\t\t\t<li>\r\n\t\t\t\tопыт работы на аналогичной должности от 2-х лет</li>\r\n\t\t\t<li>\r\n\t\t\t\tуверенный пользователь ПК (1С&sbquo; MS Office и пр.)</li>\r\n\t\t\t<li>\r\n\t\t\t\tзнания в области медицинских изделий&sbquo; оборудования приветствуются</li>\r\n\t\t\t<li>\r\n\t\t\t\tориентация на результат</li>\r\n\t\t\t<li>\r\n\t\t\t\tцелеустремленность</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Обязанности:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tвзаимодействие различными поставщиками и производителями</li>\r\n\t\t\t<li>\r\n\t\t\t\tзапрос коммерческих предложений</li>\r\n\t\t\t<li>\r\n\t\t\t\tвыполнения плана закупок</li>\r\n\t\t\t<li>\r\n\t\t\t\tсвоевременная закупка товаров</li>\r\n\t\t\t<li>\r\n\t\t\t\tналаживание контактов с новыми контрагентами</li>\r\n\t\t\t<li>\r\n\t\t\t\tведение торговой документации</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Условия:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tграфик работы 5/2</li>\r\n\t\t\t<li>\r\n\t\t\t\tдостойная заработная плата по результатам собеседования</li>\r\n\t\t\t<li>\r\n\t\t\t\tоборудованное рабочее место</li>\r\n\t\t\t<li>\r\n\t\t\t\tобучение</li>\r\n\t\t\t<li>\r\n\t\t\t\tотпуск/больничный лист</li>\r\n\t\t</ul>\r\n\t</div>\r\n\t<div class=\"span1\" style=\"text-align:center\">\r\n\t\t<div class=\"vert-shadow\" style=\"margin:auto\">\r\n\t\t\t&nbsp;</div>\r\n\t</div>\r\n\t<div class=\"span5\">\r\n\t\t<p>\r\n\t\t\t<strong style=\"font-size:150%\">Менеджер в отдел сбыта</strong></p>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Профессиональные требования:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tвысшее профильное образование</li>\r\n\t\t\t<li>\r\n\t\t\t\tопыт работы в продажах на аналогичной должности от 3-х лет</li>\r\n\t\t\t<li>\r\n\t\t\t\tуверенный пользователь ПК</li>\r\n\t\t\t<li>\r\n\t\t\t\tзнание программ 1С&sbquo; MS Office и пр</li>\r\n\t\t\t<li>\r\n\t\t\t\tзнания в области медицинских товаров и гос. закупках приветствуются.</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Обязанности:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tвзаимодействие различными поставщиками и производителями</li>\r\n\t\t\t<li>\r\n\t\t\t\tвыполнения плана продаж</li>\r\n\t\t\t<li>\r\n\t\t\t\tпродвижение товара</li>\r\n\t\t\t<li>\r\n\t\t\t\tреализация медицинских изделий&sbquo; оборудования&sbquo; лекарственных средств</li>\r\n\t\t\t<li>\r\n\t\t\t\tведение торговой документации</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Условия:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tграфик работы 5/2</li>\r\n\t\t\t<li>\r\n\t\t\t\tдостойная заработная плата по результатам собеседования</li>\r\n\t\t\t<li>\r\n\t\t\t\tоборудованное рабочее место</li>\r\n\t\t\t<li>\r\n\t\t\t\tвозможно обучение</li>\r\n\t\t\t<li>\r\n\t\t\t\tотпуск/больничный лист</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t&nbsp;</p>\r\n\t\t<p>\r\n\t\t\t&nbsp;</p>\r\n\t\t<p>\r\n\t\t\t<strong style=\"font-size:150%\">Оператор ПК</strong></p>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Профессиональные требования:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tобразование не ниже среднего специального</li>\r\n\t\t\t<li>\r\n\t\t\t\tуверенный пользователь ПК</li>\r\n\t\t\t<li>\r\n\t\t\t\tзнание торговой документации</li>\r\n\t\t\t<li>\r\n\t\t\t\tвнимательность&sbquo; ответственность&sbquo; пунктуальность</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Обязанности:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tпомощь менеджерам в подготовке различных документов</li>\r\n\t\t\t<li>\r\n\t\t\t\tсоставление первичной торговой документации</li>\r\n\t\t\t<li>\r\n\t\t\t\tвыполнение поручений начальника отдела</li>\r\n\t\t</ul>\r\n\t\t<p>\r\n\t\t\t<span style=\"color:#696969;\"><strong>Условия:</strong></span></p>\r\n\t\t<ul>\r\n\t\t\t<li>\r\n\t\t\t\tдостойная заработная плата по результатам собеседования</li>\r\n\t\t\t<li>\r\n\t\t\t\tна первых этапах возможно обучение</li>\r\n\t\t\t<li>\r\n\t\t\t\tоборудованное рабочее место</li>\r\n\t\t\t<li>\r\n\t\t\t\tграфик работы 5/2</li>\r\n\t\t\t<li>\r\n\t\t\t\tотпуск&sbquo; больничный лист</li>\r\n\t\t</ul>\r\n\t</div>\r\n</div>\r\n<p>\r\n\t&nbsp;</p>\r\n',925,NULL,NULL);
INSERT INTO `patterncontents` VALUES (69,'[TEXT_0]','<h1 style=\"text-align: center;\">\r\n\t404</h1>\r\n<h2 style=\"text-align: center;\">\r\n\tДанный товар не найден.</h2>\r\n<p style=\"text-align: center;\">\r\n\tДанный товар больше не существует на нашем сайте, перейдите на главную страницу</p>\r\n<p>\r\n\t&nbsp;</p>\r\n<p>\r\n\t&nbsp;</p>\r\n<p>\r\n\t&nbsp;</p>\r\n<p>\r\n\t&nbsp;</p>\r\n<p>\r\n\t&nbsp;</p>\r\n<p>\r\n\t&nbsp;</p>\r\n<p>\r\n\t&nbsp;</p>\r\n',926,NULL,NULL);
INSERT INTO `patterncontents` VALUES (78,'[TEXT_0]','<p>\r\n\tТекст</p>\r\n',935,NULL,NULL);
INSERT INTO `patterncontents` VALUES (81,'[TEXT_0]','<p>\r\n\tДоговор публичной оферты не нуждается в подписании на основании главы 27 ГК РФ, в частности ст. 437 ГК РФ.</p>\r\n<p>\r\n\tОпубликованное ниже предложение является публичной офертой для любого юридического или физического лица, а также для физического лица ведущего предпринимательскую деятельность. Если Вы, как потребитель, согласны с его условиями, то можете оформить Заказ и произвести его оплату. После оформления заказа Договор публичной оферты считается заключенным.</p>\r\n<p>\r\n\t<strong>1. Определения</strong></p>\r\n<p>\r\n\t1.1. Оферта &ndash; публичное предложение Поставщика, адресованное любому юридическому и физическому лицу, сюда же относятся физические лица, ведущие предпринимательскую деятельность, заключить с ним Договор на условиях, содержащихся в договоре, включая все его приложения.</p>\r\n<p>\r\n\t1.2. Договор &ndash; возмездное соглашение между Поставщиком и Покупателем на поставку Товара, заключенное посредством акцепта публичной оферты.</p>\r\n<p>\r\n\t1.3. Поставщик &ndash; Общество с ограниченной ответственностью &laquo;Дорожные геоматериалы&raquo;.</p>\r\n<p>\r\n\t1.4. Покупатель &ndash; юридическое или физическое лицо, а также физическое лицо, зарегистрированное и действующее, как индивидуальный предприниматель, заключившее с Поставщиком Договор на условиях, содержащихся в настоящем Договоре.</p>\r\n<p>\r\n\t1.5. Акцепт &ndash; полное и безоговорочное принятие Покупателем условий Договора. Акцепт подтверждается размещением Заказа Покупателем.</p>\r\n<p>\r\n\t1.6. Заказ &ndash; перечень из одного или нескольких наименований Товара, объединенных в одном документе под одним номером, содержащий информацию о наименовании Товара, его количестве, производителе, сроке (-ах) поставки Товара, цене на Товар, сведения о месте, цене и условиях доставки Товара и прочих условиях поставки и оплаты Товара.</p>\r\n<p>\r\n\t1.7. Уполномоченный представитель - любое физическое или юридическое лицо являющееся представителем Покупателя или Поставщика и совершающие действия от их имени на основании выданной доверенности.</p>\r\n<p>\r\n\t1.8. Комплект &ndash; определенный набор Товаров из двух или более отдельных компонентов, для использования его в целях, вытекающих из назначения объединяемых Товаров, поставляемых совместно, дополняющих друг друга, и очевидно предназначенных для совместного использования. Производитель присваивает Комплекту единый каталожный номер.</p>\r\n<p>\r\n\t1.9. Грузоперевозчик &ndash; транспортное предприятие или индивидуальный предприниматель, занимающийся грузоперевозками, которых нанял или указал в Заказе Покупатель, и которое используется им для доставки его Товаров в необходимое ему место.</p>\r\n<p>\r\n\t1.10. Стороны &ndash; стороны настоящего договора Покупатель и Поставщик.</p>\r\n<p>\r\n\t<strong>2. Общие положения и предмет Договора</strong></p>\r\n<p>\r\n\t2.1. Данный документ является официальным предложением (публичной офертой) ООО &laquo;Дорожные геоматериалы&raquo; &ndash; для физических и юридических лиц, в дальнейшем именуемое &laquo;Поставщик&raquo;.</p>\r\n<p>\r\n\t2.2. Поставщик обязуется поставлять Товар на основании Заказов Покупателя.</p>\r\n<p>\r\n\t2.3. Когда Покупатель нуждается в доставке Товара, он указывает это в своем Заказе. После получения Заказа на доставку товара Поставщик организует ее своими силами или путем привлечения третьих лиц за счет Покупателя.</p>\r\n<p>\r\n\t2.4. Заказы на Товар и доставку размещаются Покупателем по электронной почте, по факсу, непосредственно в офисе Поставщика.</p>\r\n<p>\r\n\t2.5. Все заказы на товар и доставку являются неотъемлемой частью данного Договора.</p>\r\n<p>\r\n\t2.6. До оформления Заказа Покупатель получает от Поставщика полный и достоверный объем информации о Товаре: по электронной почте, при посещении Покупателем офиса &ndash; от менеджеров-консультантов Поставщика. Заполнение бланка Заказа, и дальнейшая передача его к исполнению, означает достаточное и полное ознакомление Покупателя с Товаром, условиями его поставки, наличии (отсутствии) преференций, скидок, а также о влиянии условий Заказа на формирование конечной цены Товара.</p>\r\n<p>\r\n\t<strong>3. Цены, условия, порядок оплаты и поставки товаров</strong></p>\r\n<p>\r\n\t3.1. Цены на товары указываются Поставщиком в выставляемых Счетах. Ценой Оферты является общая сумма оплаченных Покупателем Счетов в течение срока действия настоящего Договора оферты без изменений и дополнений.</p>\r\n<p>\r\n\t3.2. Срок изготовления, поставки Товара по настоящему договору указывается в Счетах и исчисляется в рабочих днях, начиная с момента зачисления денежных средств авансовых платежей, полученных от Покупателя.</p>\r\n<p>\r\n\t3.3. Датой оплаты считается дата поступления денежных средств на расчетный счет Поставщика, указанный на счете.</p>\r\n<p>\r\n\t3.4. Валютой настоящего договора является Российский рубль.</p>\r\n<p>\r\n\t3.5. Поставка товаров осуществляется на условиях - самовывоза со склада Поставщика. В случае если в счете указанны другие условия поставки или на этот счет имеются иные письменные договорённости, то действуют эти, указанные в счете условия и договорённости.</p>\r\n<p>\r\n\t3.6. Покупатель обязуется вывести заказанные и оплаченные товары в течении пяти рабочих дней с даты получения уведомления о готовности товаров к отгрузке. В случае не вывоза в оговоренные сроки Покупатель, по требованию Поставщика, обязуется выплатить за хранение товаров на складе последнего неустойку из расчета 0,2% от стоимости не вывезенных в срок товаров за каждый день просрочки. Поставщик имеет право не отгружать товары до момента получения данной неустойки в полном объёме. В случае не вывоза товаров в течении пятнадцати календарных дней с момента получения уведомления о готовности Поставщик имеет право передать товары на ответственное хранение третьему (третьим) лицу. Ив данном случае Заказчик обязуется оплатить так же и услуги хранения.</p>\r\n<p>\r\n\t3.7. Поставка, отгрузка осуществляется после 100% предоплаты за продукцию.</p>\r\n<p>\r\n\t3.8. Покупатель обязуется при получении товаров на условии самовывоза предоставить правильно заполненную доверенность формы М2. Покупатель не вправе требовать отгрузить товары по иным доверенностям.</p>\r\n<p>\r\n\t3.9. Вместе с товарами Поставщик направляет Покупателю следующие документы: товарно-транспортную накладную, счет фактуру, сертификат и паспорт изделий.</p>\r\n<p>\r\n\t3.10. Право собственности на товары переходит к Покупателю в момент отгрузки товаров непосредственно представителю Покупателя, по доверенности, или в момент доставки на транспортную компанию по соответствующему поручению Покупателя.</p>\r\n<p>\r\n\t3.11. В случае отгрузки товаров через транспортную компанию или иного перевозчика право собственности на товары переходит от Поставщика к Покупателю в момент доставки на территорию транспортной компании. За повреждения, нанесённые товарам в момент разгрузки силами и средствами транспортной компании, ответственность несёт Покупатель.</p>\r\n<p>\r\n\t3.12. Основная масса товаров, предлагаемых Поставщиком изготавливается непосредственно под заказ и не может быть использована никем кроме как покупателем, соответственно приобретённые товары являются собственностью Покупателя с момента их отгрузки, и обмену или возврату, не подлежат.</p>\r\n<p>\r\n\t3.13. Качество товара должно соответствовать техническим условиям завода-изготовителя.</p>\r\n<p>\r\n\t3.14. Срок гарантии указывается в паспорте на поставляемый Товар.</p>\r\n<p>\r\n\t<strong>4. Права и обязанности Сторон</strong></p>\r\n<p>\r\n\t<em><u>4.1. Покупатель вправе:</u></em></p>\r\n<p>\r\n\t4.1.1. Потребовать возврата предоплаты в случае невозможности исполнения Поставщиком условий Заказа.</p>\r\n<p>\r\n\t4.1.2. До передачи ему Товара отказаться от исполнения договора при условии возмещения Поставщику расходов, понесенных в связи с совершением действий по выполнению настоящего Договора в размере 40% от общей стоимости Заказа.</p>\r\n<p>\r\n\t<em><u>4.2. Покупатель обязан:</u></em></p>\r\n<p>\r\n\t4.2.1. Предоставлять при оформлении Заказа точное наименование требуемого Товара. В случае самостоятельного заказа, без консультаций с менеджерами-консультантами Поставщика, нести ответственность за подбор Товара.</p>\r\n<p>\r\n\t4.2.2. Оплачивать Товар, согласно Заказам, по указанной в них цене.</p>\r\n<p>\r\n\t<em><u>4.3. Поставщик вправе:</u></em></p>\r\n<p>\r\n\t4.3.1. Не приступать к исполнению Заказа, в случае отсутствия по нему оплаты в соответствии с п.3.7.</p>\r\n<p>\r\n\t4.3.2. Не принимать претензий по несоответствию Товара и не принимать возврат Товара в случае отсутствия полных данных.</p>\r\n<p>\r\n\t4.3.3. В случае не востребования Товара Покупателем в течение 30 календарных дней с момента уведомления Покупателя о поступления Товара на склад Поставщика, расторгнуть Договор в одностороннем порядке и реализовать Товар третьим лицам. Покупатель в данном случае может получить сумму внесенной за Товар предоплаты только после продажи Товара третьим лицам за вычетом суммы, взимаемой Поставщиком за хранение Товара в течение периода с момента поступления Товара на склад и до момента его окончательной продажи.</p>\r\n<p>\r\n\t4.3.4. В случае несогласия Покупателя с изменением цен, отказаться от исполнения Заказа или его части, предложить аналогичный Товар другого производителя, изменить сроки поставки Товара.</p>\r\n<p>\r\n\t4.3.5. Не принимать к возврату Товар, а также претензий по возврату Товара без сохранения товарного вида Товара, его упаковки, а также без наличия на упаковке или самом Товаре всех наклеек и лейблов.</p>\r\n<p>\r\n\t<em><u>4.4. Поставщик обязан:</u></em></p>\r\n<p>\r\n\t4.4.1. Поставить Товар в соответствии с условиями Заказа.</p>\r\n<p>\r\n\t4.4.2. Гарантировать соответствие качества Товара требованиям качества для аналогичных Товаров на территории РФ.</p>\r\n<p>\r\n\t4.4.3. В случае изменения срока поставки, немедленно информировать Покупателя об изменении условий поставки с целью получения согласия на новые условия выполнения Заказа в целом, либо в части. Поставщик информирует Покупателя посредством телефонной либо электронной связи. Полученный ответ фиксируется в электронной истории исполнения Заказа. Покупатель считается принявшим изменившиеся условия, в случае если в течение 36 часов с момента уведомления Поставщиком об изменении договорных условий не направил в адрес Поставщика письменного отказа.</p>\r\n<p>\r\n\t4.4.4. В случае изменения цены Товара в ходе исполнения Заказа, согласовать такие изменения с Покупателем.</p>\r\n<p>\r\n\t<strong>5. Качество товара, упаковка и тара</strong></p>\r\n<p>\r\n\t5.1. Поставщик гарантирует, что передаваемый Покупателю Товар не имеет дефектов и соответствует по качеству стандартным нормам фирмы-изготовителя. Передаваемый Товар обеспечивается необходимыми документами по качеству, предусмотренными действующими нормативными актами и законодательством.</p>\r\n<p>\r\n\t<strong>6. Ответственность Сторон</strong></p>\r\n<p>\r\n\t6.1. Стороны несут ответственность за исполнение обязательств по настоящему Договору в соответствии с законодательством РФ.</p>\r\n<p>\r\n\t6.2. За просрочку оплаты, поставленного Товара свыше сроков, предусмотренных в Заказе Поставщик вправе потребовать от Покупателя уплаты неустойки в виде пени в размере 0,1 % за каждый календарный день просрочки от невыплаченной суммы.</p>\r\n<p>\r\n\t6.3. За нарушение сроков отгрузки, предусмотренных в Заказе Поставщик выплачивает Покупателю неустойку в виде пени в размере 0,1 % от стоимости неотгруженного товара&nbsp; за каждый календарный день просрочки.</p>\r\n<p>\r\n\t6.4. Стороны освобождаются от ответственности за полное или частичное неисполнение своих обязательств, если неисполнение явилось следствием таких непреодолимых обстоятельств как: война или военные действия, землетрясение, наводнение, пожар и другие стихийные бедствия, акты или действия органов государственной власти, изменение таможенных правил, ограничения импорта и экспорта, возникших независимо от воли Сторон после заключения настоящего Договора. Сторона, которая не может исполнить своих обязательств, незамедлительно извещает об этом другую Сторону и предоставляет документы, подтверждающие наличие таких обстоятельств, выданные уполномоченными на то органами.</p>\r\n<p>\r\n\t6.5. Поставщик освобождается от ответственности, в случае самостоятельного оформления Покупателем Заказа через Интернет, без запроса Поставщика провести проверку правильности подбора Товара. Запрос отправляется Поставщику в электронном виде, оформляется Поставщиком в виде бланка с присвоенным ему номером, и возвращается Покупателю с результатами проверки. В случае отсутствия указанного выше запроса, и совпадения номеров поставленного Поставщиком Товара и заказанного Покупателем, обязательства Поставщика считаются надлежаще исполненными, Товар не подлежит обмену и возврату (за исключением гарантийных случаев).</p>\r\n<p>\r\n\t<strong>7. Конфиденциальность</strong></p>\r\n<p>\r\n\t7.1. Стороны обеспечивают конфиденциальность всей информации и всех документов, полученных от другой Стороны. Дополнительного уведомления об отнесении, какого либо документа к конфиденциальным не требуется. Передача информации третьим лицам, ее опубликование или разглашение может осуществляться только по обоюдному согласию Сторон.</p>\r\n<p>\r\n\t<strong>8. Разрешение споров</strong></p>\r\n<p>\r\n\t8.1. Стороны принимают все меры к разрешению споров и разногласий, которые могут возникнуть при исполнении обязательств по Договору или в связи с этим, путем переговоров.</p>\r\n<p>\r\n\t8.2. Если стороны не могут достичь согласия по спорному вопросу, то возникшие разногласия решаются в судебном порядке в Арбитражном суде г. Ростова-на-Дону.</p>\r\n<p>\r\n\t<strong>9. Заключительные положения</strong></p>\r\n<p>\r\n\t9.1. Требования Покупателя, связанные с расторжением договора, устранением нарушений его условий, недостатками товара, возмещением убытков, передаются Поставщику в письменной форме с приложением необходимых документов, обосновывающих эти требования (документ удостоверяющий факт покупки, а также документы, подтверждающие недостатки товара и убытки, причиненные Покупателю в связи с ненадлежащим качеством товара).</p>\r\n<p>\r\n\t9.2. Настоящий договор, размещенный на интернет-сайте:http://dgm-stroy.ru и в офисе Поставщика, является публичной офертой. Отсутствие подписанного между сторонами экземпляра Договора на бумажном носителе, с проставлением подписей сторон, в случае проведения по нему фактической оплаты Покупателем, не является основанием считать настоящий Договор не заключенным. Проведение оплаты в соответствии со сделанным Заказом считается акцептом Покупателя.</p>\r\n<p>\r\n\t9.3. Любые изменения и дополнения к настоящему договору действительны при условии, если они совершены в письменной форме и подписаны Сторонами или Уполномоченными представителями Сторон.</p>\r\n<p>\r\n\t<strong>10. Реквизиты Поставщика</strong></p>\r\n<p>\r\n\tООО &laquo;Дорожные геоматериалы&raquo;</p>\r\n<p>\r\n\t344065, г. Ростов-на-Дону, ул. Троллейбусная, 24/2в, офис № 13</p>\r\n<p>\r\n\tОГРН 1146196003414</p>\r\n<p>\r\n\tИНН 6166150192</p>\r\n<p>\r\n\tКПП 616601001</p>\r\n<p>\r\n\tр/с&nbsp; 40702810607450000008 Ростовский РФ ОАО &laquo;Россельхозбанк&raquo; г. Ростов-на-Дону</p>\r\n<p>\r\n\tБИК 046015211,</p>\r\n<p>\r\n\tк/с 30101810800000000211</p>\r\n<p>\r\n\tГенеральный директор Ефремов Д.В.</p>\r\n',938,NULL,NULL);
INSERT INTO `patterncontents` VALUES (82,'[TEXT_0]','\r\n<div class=\"order_red\">\r\n\t<a class=\"a_goto\" href=\"http://62.109.30.175/files/files/%D0%94%D0%BE%D0%B3%D0%BE%D0%B2%D0%BE%D1%80%20%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D1%87%D0%BD%D0%BE%D0%B9%20%D0%BE%D1%84%D0%B5%D1%80%D1%82%D1%8B.docx\">Скачать</a></div>\r\n',939,NULL,NULL);
INSERT INTO `patterncontents` VALUES (85,'[TEXT_0]','<p>\r\n\t<strong>Монтаж геомембраны</strong></p>\r\n<p align=\"left\">\r\n\tНаиболее востребованными способами монтажа геомембраны являются укладка и сварка.</p>\r\n<p align=\"left\">\r\n\tГрамотно осуществленная укладка мембраны является залогом длительности эксплуатации строительных объектов. Функциональность данного материала дает возможность применять его в различнейших направлениях строительства.</p>\r\n<p align=\"left\">\r\n\t<strong>Укладка геомембраны</strong></p>\r\n<ul>\r\n\t<li align=\"left\">\r\n\t\tУкладка геомембраны для решения различных технологических задач:</li>\r\n\t<li align=\"left\">\r\n\t\tСооружение искусственных прудов;</li>\r\n\t<li align=\"left\">\r\n\t\tСооружение хранилищ твердых бытовых отходов;</li>\r\n\t<li align=\"left\">\r\n\t\tСооружение резервуаров с водой;</li>\r\n\t<li align=\"left\">\r\n\t\tГидроизоляция сооружений из бетона.</li>\r\n</ul>\r\n<p align=\"left\">\r\n\t<strong>Этапность укладки геомембраны следующая:</strong></p>\r\n<ul>\r\n\t<li align=\"left\">\r\n\t\tПодготовительные работы по основанию;</li>\r\n\t<li align=\"left\">\r\n\t\tФормирование и утрамбовка подушки из песка;</li>\r\n\t<li align=\"left\">\r\n\t\tУкладка слоя защиты из геотекстиля в целях предотвращения механических повреждений геомембраны и создания дополнительного армирования;</li>\r\n\t<li align=\"left\">\r\n\t\tРаскатка геомембранных рулонов;</li>\r\n\t<li align=\"left\">\r\n\t\tСварка геомембраных швов;</li>\r\n\t<li align=\"left\">\r\n\t\tКонтроль соединений на предмет герметичности.</li>\r\n</ul>\r\n<p align=\"left\">\r\n\t<strong>Сварка геомембраны</strong></p>\r\n<p align=\"left\">\r\n\tСварка мембраны является технологически сложным процессом. При использовании геомембраны для гидроизоляции при сооружении водоемов на материал водной массой оказывается большое давление и даже несущественный, на первый взгляд, сварочный дефект может стать причиной необратимости процесса разрушения системы гидроизоляции.&nbsp;&nbsp; Любые появляющиеся разрывы под воздействием давления воды начинают прогрессивно увеличиваться. Данный процесс носит необратимый характер и для устранения проблемы требуется откачка воды и ремонт гидроизоляционной системы, что является долгосрочной, дорогостоящей и трудоемкой задачей. В результате существует риск сокращения срока службы объекта в целом.</p>\r\n<p align=\"left\">\r\n\tТолько квалифицированные специалисты смогут грамотно уложить материал, осуществив затем его сварку.</p>\r\n<p align=\"left\">\r\n\tПрофессионально выполненный технологический процесс сварки мембраны обеспечивает получение качественного результата.</p>\r\n<p align=\"left\">\r\n\tКомпания &laquo;ДГМ&raquo; предлагает услуги по монтажу геомембраны. Опытные профессионалы осуществят все требуемые работы с применением современного оборудования.</p>\r\n',942,NULL,NULL);
INSERT INTO `patterncontents` VALUES (86,'[TEXT_0]','<p>\r\n\tВ зависимости от эксплуатационных задач различают несколько технологий укладки геосетки.</p>\r\n<p align=\"left\">\r\n\t1. Укладка сетки для армирования грунта осуществляется в следующей последовательности:</p>\r\n<ul>\r\n\t<li align=\"left\">\r\n\t\tПодготовительные работы по грунту &ndash; удаление растительности, корней, камней, устройство водостока, выравнивание и уплотнение грунта;</li>\r\n\t<li align=\"left\">\r\n\t\tПродольная укладка сетки с формированием нахлеста от 20 до 30 см по краям полотна, фиксирование краев материала и областей стыков;</li>\r\n\t<li align=\"left\">\r\n\t\tУкладка промежуточного слоя щебня с толщиной прослойки 0,15 м, его выравнивание и уплотнение. Слои поочередно спрессовываются катками. Предельная толщина щебеночного слоя не должна превышать &frac12; м;</li>\r\n\t<li align=\"left\">\r\n\t\tФинальный этап &ndash; укладка финишного покрытия.</li>\r\n</ul>\r\n<p align=\"left\">\r\n\t2. Укладка сетки при строительстве дорожного полотна и его ремонте производится по следующие технологии:</p>\r\n<ul>\r\n\t<li align=\"left\">\r\n\t\tДоведение поверхности под укладку до чистого и сухого состояния. Очистка поверхности осуществляется механизировано с помощью специальных щеток, воздуха под давлением от компрессоров, поливочных машин. Полотно должно быть тщательно высушено;</li>\r\n\t<li align=\"left\">\r\n\t\tДоведение полотна до ровного состояния. Проведение обследования на предмет наличия сколов, выбоин и прочих нарушений ровного рельефа. В случае обнаружении вышеуказанных дефектов&nbsp; производится укладка слоя асфальтобетона либо фрезерование дорожного полотна.</li>\r\n\t<li align=\"left\">\r\n\t\tГеосетчатый слой укладывается на ремонтируемые участки по прошествии минимум 24 часов с момента окончания работ по ремонту. Подготовленная поверхность покрывается слоем вяжущего, как правило, эмульсией битумной с 70%-м битумным содержанием).</li>\r\n\t<li align=\"left\">\r\n\t\tНепосредственно укладка самой геосетки осуществляется продольно. При этом отдельные полотна располагают с нахлестом в 100&ndash;150 мм по осям продольного направления, а&nbsp; между рулонами -&nbsp; 200&ndash;250 мм;</li>\r\n\t<li align=\"left\">\r\n\t\tРазглаживание и натяжение сетки, ее крепление строительными дюбелями, расположенными в шахматном порядке,&nbsp; к основанию;</li>\r\n\t<li align=\"left\">\r\n\t\tУкладка финишного покрытия.</li>\r\n</ul>\r\n<p align=\"left\">\r\n\tКачественное сцепление геосетки с дорожной поверхностью обеспечивается прокатом уложенного материала с&nbsp; помощью ручных катков либо прижиманием его грубой щеткой. Специальный дорожный транспорт не должен контактировать с геосеткой.</p>\r\n<p align=\"left\">\r\n\tВ случае производства работ без прерывания движения укладка материала осуществляется в 2 этапа с разделением дороги по полосам движения.</p>\r\n',943,NULL,NULL);
INSERT INTO `patterncontents` VALUES (87,'[TEXT_0]','<p>\r\n\tПроцесс укладки георешетки требует профессионального руководства.&nbsp;</p>\r\n<p align=\"left\">\r\n\tЭтапность укладки георешетки следующая:</p>\r\n<ul>\r\n\t<li align=\"left\">\r\n\t\tПодготовительные работы по поверхности;</li>\r\n\t<li align=\"left\">\r\n\t\tРаскладка георешетки;</li>\r\n\t<li align=\"left\">\r\n\t\tКрепеж ячеек решетки спец. анкерами;</li>\r\n\t<li align=\"left\">\r\n\t\tНаполнение ячеек решетки.</li>\r\n</ul>\r\n<p align=\"left\">\r\n\tЗначение верного выбора укладчика</p>\r\n<p align=\"left\">\r\n\tВ случае нарушения технологического алгоритма укладки материала существует риск возникновения пагубных последствий, для ликвидации которых станут необходимы вложения. В числе последствий нарушения технологии укладки можно выделить сдвиг, перекос и разрушение материала. Для разрешения ситуаций привлекаются профессиональные специалисты, имеющий опыт работы с геоматериалами. Таким образом, чтобы устранить риск необходимости осуществления лишних затрат на исправление нарушений монтажа материала, рекомендуется на стадии первичной укладки соблюдать принцип профессионального подхода.</p>\r\n<p align=\"left\">\r\n\tКомпания &laquo;ДГМ&raquo; предлагает своим клиентам минимизировать риски монтажных нарушений путем привлечения наших квалифицированных специалистов для укладки георешетки. Опыт работы специалистов с геосинтетическими материалами гарантирует качественное и своевременное решение технологических задач.</p>\r\n<p align=\"left\">\r\n\tПрофессионалы смогут на месте ответить на вопросы, касающиеся последующей эксплуатации строения/сооружения.</p>\r\n<p align=\"left\">\r\n\tВысокая продолжительность эксплуатационного периода георешетки способствует использованию материала в различных сферах:</p>\r\n<ul>\r\n\t<li align=\"left\">\r\n\t\tукрепление грунта (откосы/склоны);</li>\r\n\t<li align=\"left\">\r\n\t\tстроительство спортивных, детских площадок, экопарковок;</li>\r\n\t<li align=\"left\">\r\n\t\tукрепление полотен дорог;</li>\r\n\t<li align=\"left\">\r\n\t\tсоздание предметов ландшафтного дизайна.</li>\r\n</ul>\r\n<p align=\"left\">\r\n\tКомпания &laquo;ДГМ&raquo; предлагает услуги по укладке и монтажу геоматериалов.</p>\r\n',944,NULL,NULL);
INSERT INTO `patterncontents` VALUES (88,'[TEXT_0]','<p>\r\n\tПрименение в различных направлениях строительства габионов &nbsp; все более актуализируется. Это объясняется отличными функциональными свойствами материала, эффективной практической применимостью и длительностью эксплуатации. Можно утверждать, что временной фактор не только не разрушает габионы, но и напротив &ndash; укрепляет сооружение за счет прорастания корней и сливания с поверхностью. Помимо традиционных направлений использования габионы применяют также и для противоселевых, противокамнепадных и противолавинных сооружений и для фундаментов строений.</p>\r\n<p align=\"left\">\r\n\tЭтапы монтажа габионов следующие:</p>\r\n<ul>\r\n\t<li align=\"left\">\r\n\t\tсборка непосредственно габионов;</li>\r\n\t<li align=\"left\">\r\n\t\tустановка собранной конструкции на объекте;</li>\r\n\t<li align=\"left\">\r\n\t\tнаполнение конструкции;</li>\r\n\t<li align=\"left\">\r\n\t\tсвязывание единичных габионных конструкций в единое защитное сооружение.</li>\r\n</ul>\r\n<p align=\"left\">\r\n\tС учетом массива и тяжести габионных конструкций требуется обстоятельный подход к продумыванию их монтажа ибо после сборки цельного сооружения демонтаж крайне затруднителен. Грамотная установка габионов гарантирует эффективность результата и предотвращение потенциального демонтажа.</p>\r\n<p align=\"left\">\r\n\tПрофессиональная установка</p>\r\n<p align=\"left\">\r\n\tКомпания &laquo;ДГМ&raquo; предоставляет услуги по профессиональному монтажу габионных конструкций опытными специалистами. Подобный подход в решению монтажных задач обеспечит качество и долговечность&nbsp; конструктива в целом.</p>\r\n<p align=\"left\">\r\n\t&nbsp;</p>\r\n',945,NULL,NULL);
INSERT INTO `patterncontents` VALUES (89,'[TEXT_0]','<p>\r\n\tВопрос необходимости применения в сфере дорожного строительства высококачественных материалов, разработанных на основе новейших технологий, в настоящее время особенно актуален. Смертность при автомобильных авариях в нашей стране остается очень высокой, ежегодно погибают или травмируются около 27 тыс. человек.</p>\r\n<p>\r\n\tДорожные ограждения выступают одним из ключевых элементов обеспечения безопасности автомобильного движения. В настоящее время необычайно актуален вопрос снижения аварийности и минимизации последствий аварий.</p>\r\n<p>\r\n\tБарьерное ограждение дорожное служит своего рода поглотителем энергии удара, возникающего при столкновении с ограждением. Кроме того, применение данной конструкции предотвращает попадание автомобиля на встречную полосу в случае аварии.</p>\r\n<p>\r\n\tПроизводство дорожных ограждений активно осуществляется на территории Российской Федерации. Отечественные производители успешно применяют современные технологии, обеспечивающие высокое качество изделий.&nbsp; При этом, существуют государственные стандарты производства, в частности ГОСТ 26804&nbsp; 81, ГОСТ Р 52289-2004.</p>\r\n<p>\r\n\tДорожные ограждения ГОСТ имеют высокие технические характеристики, позволяющие конструкциям эффективно выполнять свои защитные функции. Продукция сертифицируется производителем в обязательном порядке.</p>\r\n<p>\r\n\tТипы дорожного ограждения следующие: односторонние; двусторонние; одностороннее мостовое; двустороннее мостовое. Также при необходимости (ремонт, замена) можно приобрести отдельные элементы конструкции: консоли, стойки, секции балки, элементы световозвращающие. Металлические дорожные ограждения устанавливают на разделительных полосах, обочинах, на мостах и эстакадах. Помимо защиты транспортных средств данные оградительные конструкции предотвращают выход животных на проезжую часть, защищают пешеходов на насыпях и мостах. Дорожные ограждения барьерного типа являются высокопрочными конструкциями, могут изготавливаться как из металла, бетона, так и из пластика. Металлические барьерные дорожные ограждения находят более широкое применение на крупных автомагистралях, федеральных трассах, дорожное ограждение пластиковое же чаще используют на дорогах с меньшей загруженностью. При помощи данных конструкций границы дороги очерчиваются и предотвращается попадание на полотно крупногабаритных предметов. Ограждение дорожное металлическое барьерного типа, в отличии от бетонного, более безопасно для транспортных средств в случае столкновения. Его применение нанесет несоизмеримо меньший ущерб автомобилю, повысит шансы на выживание и минимизацию травм для водителя и пассажиров.</p>\r\n<p>\r\n\tУстановка дорожных ограждений осуществляется на основании схемы сборки, содержащей непосредственно само устройство дорожных ограждений; конструкция собирается из элементов, скрепляется специальными болтами. ООО &laquo;ДГМ&raquo; оказывает консультационную поддержку по вопросам сборки и установки изделий. После установки может быть осуществлена разметка дорожных ограждений. Монтаж конструкций,&nbsp; хотя и не является технически очень сложным, требует контроля профессионалов.</p>\r\n<p>\r\n\tДорожное ограждение купить можно, обратившись в компанию ООО &laquo;ДГМ&raquo;. Мы предлагаем качественный товар по приемлемой цене, обеспечим доставку изделий на объект, предоставим всю сопутствующую документацию.</p>\r\n',946,NULL,NULL);
INSERT INTO `patterncontents` VALUES (90,'[TEXT_0]','<p class=\"mg1\">\r\n\tКомпания гарантирует высокое качество своей продукции и несёт ответственность за его несоблюдение согласно строгим производственным стандартам и законодательству РФ.</p>\r\n<h3 class=\"mg1\">\r\n\tГарантия качества</h3>\r\n<p class=\"mg1\">\r\n\tТовар, приобретённый в нашем интернет-магазине, должен строго соответствовать заказу, подходить на указанный в заказе автомобиль, не иметь дефектов материала, окантовки и крепёжных элементов, нарушающих его внешний вид и эксплуатационные свойства.</p>\r\n<p>\r\n\tНаша продукция выпускается из высококачественных отечественных материалов, что позволяет эксплуатировать автомобильные коврики до 3 лет и дольше при бережном обращении и надлежащем уходе. Конкретный срок службы зависит от самого владельца, интенсивности эксплуатации, манеры вождения и применяемой обуви. Следует помнить, что мягкий полимер EVA, наделяющий коврики рядом уникальных свойств, менее стоек к воздействию острыми предметами или шпильками. В случаях, если предполагается активная эксплуатация (в такси, например) или частый контакт с агрессивной обувью (на жёстких и острых каблуках), мы рекомендуем установку на водительский коврик защитного подпятника. К тому же у нас всегда можно заказать отдельный коврик комплекта, если он со временем износился раньше остальных, потерял приятный внешний вид или случайно повредился - весь комплект менять не обязательно. Мы не даём гарантии на 3-5 лет эксплуатации, 100-200 тысяч километров пробега или иные пустые рекламные обещания, которые легко раздают некоторые недобросовестные производители, потому что хорошо разбираемся в вопросе и хотим быть честны с Вами - срок службы ковриков зависит от условий эксплуатации и не может быть строго определён годами или километрами пробега, но в целом мало отличается от срока службы качественных ковриков других видов.</p>\r\n<h3 class=\"mg1\">\r\n\tВозврат или обмен товара ненадлежащего качества.</h3>\r\n<p class=\"mg1\">\r\n\tЕсли приобретенный у нас товар не подходит по форме, креплениям или имеет дефекты, нарушающие его внешний вид и эксплуатационные свойства, Вы вправе потребовать обменять его на аналогичный товар надлежащего качества или вернуть его, получив обратно уплаченные за него средства. Для этого необходимо связаться с нами одним из указанных ниже способов, сообщить номер своего заказа и описать проблему или претензию.</p>\r\n<p class=\"mg1\">\r\n\tНаш специалист может попросить предоставить фотографии, подтверждающие или поясняющие суть претензии, которые необходимо отправить удобным Вам способом. Иногда проблема совместимости вызвана неверной установкой или ориентацией ковриков - в таком случае консультация с нашим специалистом быстро решает проблему.</p>\r\n<p class=\"mg1\">\r\n\tЕсли дефект или несоответствие формы подтверждается, мы в кратчайшие сроки заменим товар, взяв на себя все транспортные расходы, или вернём деньги при невозможности осуществить замену в приемлемые сроки.</p>\r\n<p class=\"mg1\">\r\n\tВозврат или обмен товара надлежащего качества, несоответствующего заказу.</p>\r\n<p class=\"mg1\">\r\n\tЕсли приобретённый у нас товар имеет надлежащее качество, но не соответствует заказу по цвету или комплектации, Вы вправе потребовать его обмен или возврат, действуя так же, как и в случае с товаром ненадлежащего качество, описанном выше.</p>\r\n<p class=\"mg1\">\r\n\tВозврат или обмен товара надлежащего качества, соответствующего заказу.</p>\r\n<p class=\"mg1\">\r\n\tВся продукция нашей компании производится по индивидуальному заказу, поэтому возврат или обмен товара надлежащего качества, соответствующего Вашему заказу, возможен только по согласованию с нашими менеджерами и с компенсацией транспортных расходов Покупателем. В таком случаем мы оставляем за собой право отказать в возврате или обмене товара редкой модели и/или цветового сочетания.</p>\r\n<p class=\"mg1\">\r\n\t<strong>Возмещение денежных средств за возвращённый товар.</strong></p>\r\n<p class=\"mg1\">\r\n\t1) при онлайн-оплате заказа на сайте через сервис Яндекс.Касса деньги за возвращённый товар будут зачислены на источник совершённой оплаты в течение 3-10 дней после получения возвращённого товара.</p>\r\n<p class=\"mg1\">\r\n\t2) при оплате заказа переводом на карту или наличными при получении, возврат денег производится на Вашу банковскую карту или почтовым переводом в течение 3-10 дней после получения возвращённого товара.</p>\r\n<p>\r\n\t<strong>По любым вопросам, связанным с гарантийными обязательствами компании, Вы можете обратиться к нашим менеджерам по телефону 8 (499) 388-22-55</strong></p>\r\n',947,NULL,NULL);
INSERT INTO `patterncontents` VALUES (98,'[TEXT_0]','<h1>\r\n\tНовости</h1>\r\n<p>\r\n\t</p>\r\nРоссийские дилеры Audi начнут принимать предварительные заказы на новый кроссовер Q2 в конце 2016 года, а продажи модели стартуют на нашем рынке в январе 2017 года, рассказали в компании. Технические характеристики российской версии «паркетника» будут объявлены позже, о цене и вовсе рано говорить – автомобиль дебютировал всего пару дней назад, пока не оглашен прайс-лист даже для Европы. Однако новинка окажется на ступеньку ниже Q3, соответственно цена «двойки» тоже будет меньше.',951,NULL,NULL);
