INSERT INTO `patterncontents` VALUES (137,'[TEXT_0]','<h1>Часто задаваемые вопросы</h1>\r\n<p>\r\n\t\t\t<strong>ЕСТЬ ЛИ У КОВРИКОВ ГАРАНТИЙНЫЙ СРОК СЛУЖБЫ?</strong></p>\r\n\t\t<p>\r\n\t\t\tСрок службы изделий из EVA во многом зависит от их владельца, его манеры вождения, от условий, в которых они используются. Если у вас не было проблем с этими аксессуарами из текстиля или резины, то и наши могут прослужить вам несколько лет.</p>\r\n\t\t<p>\r\n\t\t\t<strong>ОТЛИЧАЮТСЯ ЛИ КОВРИКИ ОТ ОРИГИНАЛЬНЫХ?</strong></p>\r\n\t\t<p>\r\n\t\t\tНаши изделия могут отличаться от оригинальных. Причина этого в том, что мы выкраиваем их по собственным лекалам. Но это не является недостатком, а в некоторых случаях даже преимуществом.</p>\r\n\t\t<p>\r\n\t\t\t<strong>КАКИЕ КОВРИКИ ЛУЧШЕ ПОДОЙДУТ ДЛЯ ОСЕНИ?</strong></p>\r\n\t\t<p>\r\n\t\t\tВсе аксессуары EVA прекрасно подходят для использования в осенний сезон. Они не размякнут от воды (в отличие от текстильных ковриков), которой будет много от частых дождей, и не задубеют на морозе, что случается с резиновыми.</p>\r\n\t\t<p>\r\n\t\t\t<strong>КАК УХАЖИВАТЬ ЗА КОВРИКАМИ?</strong></p>\r\n\t\t<p>\r\n\t\t\tКоврики рассчитаны на мойку струей воды под давлением. Под ее напором вся скопившаяся грязь в ячейках моментально вымывается. Они не боятся автошампуней и моющих средств. Их можно мыть каждый раз, когда приезжаете на автомойку.</p>\r\n\t\t<p>\r\n\t\t\t<strong>КОГДА У ВАС ПОЯВЯТСЯ КОВРИКИ НА МОЮ МОДЕЛЬ? МОГУ Я КАК-ТО ПОСПОСОБСТВОВАТЬ?</strong></p>\r\n\t\t<p>\r\n\t\t\tНаш модельный ряд постоянно расширяется. </p>\r\n\t\t<p>\r\n\t\t\t<strong>ИЗ КАКОГО МАТЕРИАЛА ИЗГОТОВЛЕНЫ КОВРИКИ?</strong></p>\r\n\t\t<p>\r\n\t\t\tДля изготовления ковриков мы используем инновационный материал с ячеистой структурой – Ethylene Vinyl Acetate (EVA или севилен). Он очень легкий и в то же время прочный, функциональный и стильный, удобный и при этом недорогой. Среди преимуществ этого материала: способность удерживать большое количество жидкости, отсутствие запаха, стойкость к химическим реагентам, абсолютная безопасность для здоровья и окружающей среды, сохранение всех характеристик и при жаре +50°С, и в холоде -40°С, а также многое другое.</p>\r\n\t\t<p>\r\n\t\t\t<strong>БОЯТСЯ ЛИ КОВРИКИ ОСТРЫХ ШПИЛЕК?</strong></p>\r\n\t\t<p>\r\n\t\t\tИзносостойкость у ковриков EVA довольно высокая. Однако из-за относительной мягкости и эластичности материала (что дарит комфорт под ногами) структуру можно повредить шпильками и другими острыми предметами.</p>\r\n\t\t<p>\r\n\t\t\t<strong>СКОЛЬКО СЛУЖАТ КОВРИКИ?</strong></p>\r\n\t\t<p>\r\n\t\t\tСрок службы автомобильных ковриков EVA не уступает текстильным и резиновым аналогам. При бережном использовании и своевременном уходе они могут прослужить вам несколько лет. Однако важно избегать контакта их поверхности с острыми предметами.</p>\r\n\t\t<p>\r\n\t\t\t<strong>ИМЕЮТ ЛИ КОВРИКИ ЗАПАХ?</strong></p>\r\n\t\t<p>\r\n\t\t\tОни могут иметь запах, как и любые другие изделия, только, если они новые. Но он быстро выветривается и не появится вновь. Материал EVA (севилен) изготавливается из экологически безопасных компонентов и в дальнейшей эксплуатации не будет пахнуть даже при сильно повышенных температурах (+50°С).</p>\r\n\t\t<p>\r\n\t\t\t<strong>НЕ ПОРТЯТ ЛИ КОВРИКИ ОБУВЬ?</strong></p>\r\n\t\t<p>\r\n\t\t\tОни не только не портят обувь, а даже, наоборот, помогают сохранить ее чистой. Поверхность ковриков EVA имеет ромбовидные ячейки, которые надежно удерживают влагу, пыль, песок и прочую грязь до тех пор, пока их не снимут и не начнут вытряхивать. Кроме того, автоковрики не стирают подошву. Сам материал EVA даже применяется в производстве спортивной обуви.</p>\r\n\t\t<p>\r\n\t\t\t<strong>КАК ОСУЩЕСТВЛЯЕТСЯ КРЕПЛЕНИЕ КОВРИКОВ?</strong></p>\r\n\t\t<p>\r\n\t\t\tКрепление преимущественно осуществляется с помощью «липучек». Но для моделей авто, которые оборудованы заводскими держателями, мы делаем коврики с соответствующими крепежами.</p>\r\n\t\t<p>\r\n\t\t\t<strong>КАКИЕ КОВРИКИ ЛУЧШЕ ПОДОЙДУТ ДЛЯ ЗИМЫ?</strong></p>\r\n\t\t<p>\r\n\t\t\tКоврики EVA всесезонны: они стойко переносят и высокие, и низкие температуры. Они не становятся хрупкими и не трескаются даже при -40 °С. Кроме того, уникальный материал, из которого выполнены наши коврики, спокойно выдерживает контакт с химическими реагентами, применяемыми на дорогах в холодное время года. </p>\r\n\t\t<p>\r\n\t\t\t<strong>КАК ПРАВИЛЬНО УКЛАДЫВАТЬ КОВРИК EVA?</strong></p>\r\n\t\t<p>\r\n\t\t\tПри разработке лекал мы старались, чтобы коврики закрывали максимально возможную область пола. Очень часто они по размерам больше, чем оригинальные коврики или изделия других производителей. Поэтому может показаться, что они слишком большие и их трудно уложить.</p>\r\n\t\t<p>\r\n\t\t\t<strong>У КОВРИКОВ EVA НЕТ БОРТИКОВ, НЕ БУДЕТ ЛИ ПЕРЕЛИВАТЬСЯ ВОДА ЗА КРАЙ?</strong></p>\r\n\t\t<p>\r\n\t\t\tЭтот вопрос задается очень часто. Многие проводят аналогию с резиновыми ковриками в форме ванночек, которым действительно необходимы бортики.</p>\r\n\t\t<p>\r\n\t\t\t<strong>КАКОЙ ЦВЕТ МЕНЬШЕ ВСЕГО ПАЧКАЕТСЯ?</strong></p>\r\n\t\t<p>\r\n\t\t\tСамые практичные цвета для автоковриков – серый и бежевый. В ассортименте нашей компании представлен 1 серый цвет и 2 оттенка бежевых. Самое популярное цветовое сочетание – серый коврик с черной окантовкой. Он отлично подходит для темных салонов. Бежевые же идеальны для светлых салонов, но и в темных смотрятся очень оригинально, особенно если там присутствуют светлые элементы. Окантовку для бежевых лучше выбирать либо точно в цвет, либо черную. Если сравнивать по практичности серый и бежевый цвета, то на бежевых меньше заметны сухие пыль, мусор и песок, имеющие по своей природе светло-бежевый (песочный) оттенок и визуально сливающиеся с ковриками. А в сырую погоду, наоборот, практичнее будут серые, поскольку на них меньше заметна мокрая грязь.</p>\r\n\t\t<p>\r\n\t\t\t<strong>ПОЛУЧИТЬ КОВРИКИ EVA!</strong></p>\r\n\t\t<p>\r\n\t\t\tВ течение нескольких рабочих дней ваш заказ будет изготовлен и отправлен выбранным при заказе способом. Менеджер сообщит вам номер трека для отслеживания статуса посылки на сайте почты России или транспортной компании.</p>',976,NULL,NULL);
INSERT INTO `patterncontents` VALUES (138,'[TEXT_0]','<h1>Премущества ковриков EVA</h1>\r\n<p>\r\n\t\t\tДо недавнего времени наиболее распространенными материалами для изготовления автомобильных ковриков были резина и текстиль. EVA имеет ряд существенных преимуществ по сравнению с ними:</p>\r\n\t\t<p>\r\n\t\t\t<img src=\"https://www.duffcar.ru/images/about/05.png\" style=\"width:100%\" /></p>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span1\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/06.png\" /></div>\r\n\t\t\t<div class=\"span11\">\r\n\t\t\t\t<strong>1. Севилен</strong> – достаточно жесткий и прочный материал. Коврики, изготовленные из него, состоят из ромбовидных ячеек глубиной 8 мм при общей толщине изделия 10 мм. В результате им не требуются бортики для удержания воды – она равномерно распределяется по ячейкам, что невозможно в случае с резиновыми или текстильными изделиями.\r\n\t\t\t\t<p>\r\n\t\t\t\t\t </p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span1\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/07.png\" /></div>\r\n\t\t\t<div class=\"span11\">\r\n\t\t\t\t<strong>2. Ячейки ковриков надежно удерживают воду</strong>. Чтобы ее вылить, изделие требуется держать практически вертикально. Это гарантирует, что вода в салоне не будет расплескиваться, как может происходить с резиновыми изделиями.\r\n\t\t\t\t<p>\r\n\t\t\t\t\t </p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span1\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/08.png\" /></div>\r\n\t\t\t<div class=\"span11\">\r\n\t\t\t\t<strong>3. Так же надежно наши коврики удерживают твердый мусор, песок или грунт и не дают им перемещаться по салону</strong>. Грязь собирается на дне ячеек и не мешается под ногами. Это бесспорное преимущество нашей продукции перед резиновыми и велюровыми аналогами.\r\n\t\t\t\t<p>\r\n\t\t\t\t\t </p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span1\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/09.png\" /></div>\r\n\t\t\t<div class=\"span11\">\r\n\t\t\t\t<strong>4. Материал EVA рассчитан на эксплуатацию до -50 °С</strong>. Он не твердеет и не подвержен образованию трещин, как это бывает с резиновыми изделиями.\r\n\t\t\t\t<p>\r\n\t\t\t\t\t </p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span1\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/10.png\" /></div>\r\n\t\t\t<div class=\"span11\">\r\n\t\t\t\t<strong>5.То же самое можно сказать и об эксплуатации в жаркое время года</strong>. Севилен абсолютно спокойно переносит нагревание до +50 °С. При этом он не деформируется, не становится токсичным и не имеет запаха. Его абсолютную безопасность подтверждает сертификат РОСТЕСТа.\r\n\t\t\t\t<p>\r\n\t\t\t\t\t </p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span1\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/11.png\" /></div>\r\n\t\t\t<div class=\"span11\">\r\n\t\t\t\t<strong>6 EVA абсолютно равнодушен к воздействию химических реагентов, использующихся в зимнее время для борьбы с обледенением дорог</strong>. Одновременно он способен защитить от их воздействия обувь водителя и пассажиров: химикаты скапливаются в ячейках коврика и минимально контактируют с подошвами. Резиновые или текстильные изделия обеспечить такой защиты не могут.\r\n\t\t\t\t<p>\r\n\t\t\t\t\t </p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span1\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/12.png\" /></div>\r\n\t\t\t<div class=\"span11\">\r\n\t\t\t\t<strong>7. Легкая чистка</strong>. Для этого достаточно перевернуть коврик и вытряхнуть его. К тому же ячеистая структура вмещает достаточно мусора, чтобы чистку не приходилось выполнять часто. Конечно, это лишь временная мера и периодически ему нужна влажная уборка под давлением. Однако особенности конструкции позволяют делать ее реже.\r\n\t\t\t\t<p>\r\n\t\t\t\t\t </p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span1\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/13.png\" /></div>\r\n\t\t\t<div class=\"span11\">\r\n\t\t\t\t<strong>8. После чистки коврики быстро сохнут, поскольку они не впитывают влагу</strong>. Этим EVA выгодно отличаются от текстиля, который имеет ворсистую поверхность и прорезиненное дно, поэтому медленно отдает накопленную влагу.\r\n\t\t\t\t<p>\r\n\t\t\t\t\t </p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span1\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/14.png\" /></div>\r\n\t\t\t<div class=\"span11\">\r\n\t\t\t\t<strong>9. Внешний вид ковриков от DuffCar выгодно отличается от других предложений</strong>.Более 150 комбинации цвета ковриков и окантовки дают возможность предать индивидуальности салону вашего авто и выбрать свой стиль\r\n\t\t\t\t<p>\r\n\t\t\t\t\t </p>\r\n\t\t\t</div>\r\n\t\t</div>\r\n\t\t<p>\r\n\t\t\t<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"https://www.youtube.com/embed/ZoBvTBnzOcY\" style=\"width:100%;min-height:450px;\"></iframe></p>\r\n\t\t<p>\r\n\t\t\t </p>\r\n\t\t<hr />\r\n\t\t<h2>\r\n\t\t\t </h2>\r\n\t\t<h2>\r\n\t\t\tДля кого эти коврики станут лучшим выбором?</h2>\r\n\t\t<p>\r\n\t\t\t </p>\r\n\t\t<div class=\"row-fluid\">\r\n\t\t\t<div class=\"span6\">\r\n\t\t\t\t<ul class=\"advantage_list\">\r\n\t\t\t\t\t<li>\r\n\t\t\t\t\t\t<strong>Для тех, кто часто путешествует</strong> в непогоду и хочет при этом сохранять салон чистым, а одежду — незапятнанной;</li>\r\n\t\t\t\t\t<li>\r\n\t\t\t\t\t\t<strong>Для тех, кто любит комфорт и удобство во всём</strong>: коврики из материала EVA идеально подходят для того, чтобы обеспечить максимум положительных эмоций от их применения;</li>\r\n\t\t\t\t\t<li>\r\n\t\t\t\t\t\t<strong>Для тех, кто ищет интересное дизайнерское решение</strong> в салон и, разумеется, для всех тех, кто любит себя и свой автомобиль</li>\r\n\t\t\t\t\t<li>\r\n\t\t\t\t\t\t<strong>Коврики в салон отличаются многообразием расцветок</strong>: возможны как классические, так и сверхъяркие решения</li>\r\n\t\t\t\t\t<li>\r\n\t\t\t\t\t\t<strong>Вы всегда можете купить любой коврик отдельно</strong>, не обязательно брать весь комплект</li>\r\n\t\t\t\t</ul>\r\n\t\t\t</div>\r\n\t\t\t<div class=\"span6\">\r\n\t\t\t\t<img src=\"https://www.duffcar.ru/images/about/15.png\" /></div>\r\n\t\t</div>',977,NULL,NULL);
INSERT INTO `patterncontents` VALUES (139,'[TEXT_0]','<h1>\r\n\tПроизводителям</h1>\r\n<p>\r\n\tПоставки листового материала EVA оптом и в розницу. Оставь заявку на приобретение листов для EVA ковриков.</p>\r\n<p>\r\n\t&nbsp;</p>\r\n',978,NULL,NULL);
