lass=\"mg1\">\r\n\t1) при онлайн-оплате заказа на сайте через сервис Яндекс.Касса деньги за возвращённый товар будут зачислены на источник совершённой оплаты в течение 3-10 дней после получения возвращённого товара.</p>\r\n<p class=\"mg1\">\r\n\t2) при оплате заказа переводом на карту или наличными при получении, возврат денег производится на Вашу банковскую карту или почтовым переводом в течение 3-10 дней после получения возвращённого товара.</p>\r\n<p>\r\n\t<strong>По любым вопросам, связанным с гарантийными обязательствами компании, Вы можете обратиться к нашим менеджерам по телефону 8 (499) 388-22-55</strong></p>\r\n',959,NULL,NULL);
INSERT INTO `patterncontents` VALUES (179,'[TEXT_0]','<p>Материал EVA, из которого мы изготавливаем автомобильные коврики, обладает прекрасной амортизацией, практически не изнашивается, стоек к воздействиям растворителей, масел и других химических веществ, выдерживает очень низкую и высокую температуру окружающей среды (от &minus;80 до +55 градусов).&nbsp;</p>\r\n\r\n<p>Кроме того, материал не пропускает воду и грязь и не проводит электричество. Но одним из главных преимуществ этого полимера является тот факт, что автоковрики из этиленвинилацетата абсолютно экологичны и безопасны, не вызывают аллергии и стойки к воздействию болезнетворных бактерий и грибков, что особенно важно, если в салоне машины находятся дети.</p>\r\n',1001,NULL,NULL);
