lass=\"mg1\">\r\n\t1) при онлайн-оплате заказа на сайте через сервис Яндекс.Касса деньги за возвращённый товар будут зачислены на источник совершённой оплаты в течение 3-10 дней после получения возвращённого товара.</p>\r\n<p class=\"mg1\">\r\n\t2) при оплате заказа переводом на карту или наличными при получении, возврат денег производится на Вашу банковскую карту или почтовым переводом в течение 3-10 дней после получения возвращённого товара.</p>\r\n<p>\r\n\t<strong>По любым вопросам, связанным с гарантийными обязательствами компании, Вы можете обратиться к нашим менеджерам по телефону 8 (499) 388-22-55</strong></p>\r\n',1003,NULL,NULL);
INSERT INTO `patterncontents` VALUES (190,'[TEXT_0]','<p>\r\n\tСодержание<br />\r\n\t&nbsp;</p>\r\n',NULL,75,NULL);
INSERT INTO `patterncontents` VALUES (191,'[TEXT_0]','<p>\r\n\tПредоставляя свои персональные данные Пользователь даёт согласие на обработку, хранение и использование своих персональных данных на основании ФЗ № 152-ФЗ &laquo;О персональных данных&raquo; от 27.07.2006 г. в следующих целях:<br />\r\n\t<br />\r\n\t&nbsp;&nbsp;&nbsp; Осуществление клиентской поддержки<br />\r\n\t&nbsp;&nbsp;&nbsp; Получения Пользователем информации о маркетинговых событиях.<br />\r\n\t&nbsp;&nbsp;&nbsp; Проведения аудита и прочих внутренних исследований с целью повышения качества предоставляемых услуг.<br />\r\n\t<br />\r\n\tПод персональными данными подразумевается любая информация личного характера, позволяющая установить личность Пользователя/Покупателя такая как:<br />\r\n\t<br />\r\n\t&nbsp;&nbsp;&nbsp; Фамилия, Имя, Отчество<br />\r\n\t&nbsp;&nbsp;&nbsp; Дата рождения<br />\r\n\t&nbsp;&nbsp;&nbsp; Контактный телефон<br />\r\n\t&nbsp;&nbsp;&nbsp; Адрес электронной почты<br />\r\n\t&nbsp;&nbsp;&nbsp; Почтовый адрес<br />\r\n\t<br />\r\n\tПерсональные данные Пользователей хранятся исключительно на электронных носителях и обрабатываются с использованием автоматизированных систем, за исключением случаев, когда неавтоматизированная обработка персональных данных необходима в связи с исполнением требований законодательства.<br />\r\n\t<br />\r\n\tКомпания обязуется не передавать полученные персональные данные третьим лицам, за исключением следующих случаев:<br />\r\n\t<br />\r\n\tПо запросам уполномоченных органов государственной власти РФ только по основаниям и в порядке, установленным законодательством РФ Стратегическим партнерам, которые работают с Компанией для предоставления продуктов и услуг, или тем из них, которые помогают Компании реализовывать продукты и услуги потребителям. Мы предоставляем третьим лицам минимальный объем персональных данных, необходимый только для оказания требуемой услуги или проведения необходимой транзакции.<br />\r\n\t<br />\r\n\tКомпания оставляет за собой право вносить изменения в одностороннем порядке в настоящие правила, при условии, что изменения не противоречат действующему законодательству РФ. Изменения условий настоящих правил вступают в силу после их публикации на Сайте.</p>\r\n',1004,NULL,NULL);
